(173, '1317d4b0-09b9-4976-8bdb-c16964d105d9', 329, '<p>The </p><p><em>[https://treatmentplan.xyz/onyx/Viewer/show.html?mlink=https://treatmentplan.xyz/onyx/Client4745/D0215-Mohamed%20Umar/7A635AE5A551407CB576F8503416107E.iiwgl&amp;fg=000&amp;bg=fff&amp;p=WSMOLA] </em></p><p><br></p><p><strong>Plan 02</strong> has been approved. please send the Step files as soon as possible to start the fabrication</p><p><br></p>', 9, 0, '2024-08-07 15:04:47', '2024-08-07 15:04:47'),
(174, '7802831a-5716-458c-8149-ebff44dab5d7', 319, '<p>We have done expansion to gain some more space as by only doing 14 mesialization, we were not able to achieve the space required for implant. Along with that, the alignment got better in 10 sets of aligners.&nbsp;</p><p>Please consider the above scenarios and let us know if you feel any discrepancy in the setup&nbsp;</p><p>Thankyou</p>', 7, 0, '2024-08-07 16:50:14', '2024-08-07 16:50:14'),
