(260, 'e9c08f82-647f-40f2-8037-947bb9713ad3', 795, '<p>PLAN 01</p><p>Revise and do in reduced trays&nbsp;</p><p>Upper 14</p><p>Lower 14</p><p><br></p><p>And send revised plan&nbsp;</p><p><br></p>', 8, 0, '2024-09-05 17:45:43', '2024-09-05 17:45:43'),
