(262, 'f5b6a945-2673-4354-a524-f9e2cb36305f', 805, '<p>We have seated the bite manually as there are 2 different bite pictures.&nbsp;Please confirm us the correct bite picture. Along with that, provide us with lateral bite pictures as well.&nbsp;</p><p>We have extracted 31 in the lower arch to resolve crowding . Midline and overjet are improved.&nbsp;&nbsp;</p><p>Thankyou</p>', 7, 0, '2024-09-06 01:40:15', '2024-09-06 01:40:15'),
(263, '74f8e25c-05bb-44d2-8cbd-82502f08f106', 806, '<p><span style=\"color: black;\">SANDARU DAMSARA</span></p><p>D0282</p><p>REVISION 1</p><p>EXPECTED CORRECTIONS FROM 33 UPPER ALIGNER/ 33 LOWER ALIGNER</p><p>MAXILLARY ARCH</p><p>1. Distalize and distally rotate 17,16,15,14,13 upto 2 mm to achieve class 1 molar and class I canine relationship on the right upper posterior quadrant. </p><p>2. Distalize and distally rotate 27,26,25,24,23 upto 2 mm to achieve class 1 molar and class I canine relationship on the upper left quadrant. </p><p>3. Achieve adequate expansion </p><p>4. IPR distal of 13,14,15 and 23,24,25 upto 0.5mm each tooth. Space gained can be utilized to achieve good posterior intercuspation and achieve class 1 molar and class I canine relationship bilaterally</p><p>5. Anterior spacing can be utilized to intrude the upper anterior teeth to improve the deep bite</p><p>6. Reduce the resulting and final overjet</p><p>7. Achieve ideal overjet and overbite</p><p>&nbsp;</p><p>LOWER ARCH</p><p>&nbsp;</p><p>1. Do minimal IPR in 31,32,33 and 41,42,43 upto 0.25mm to address the lower dental midline shift to match with the maxillary dental midline, intrusion of lower anterior and mesialize posterior teeth to achieve class 1 molar relationship bilaterally</p><p>2. Do IPR in 33,34,35 upto 0.5mm each tooth to mesialize 34,35 and 36 to achieve class 1 molar and class 1 canine relationship in the left lower posterior quadrant</p><p>3. Do IPR in 43,44,45 upto 0.5mm each tooth to mesialize 44,45 and 46 to achieve class 1 molar and class 1 canine relationship in the right lower posterior quadrant</p>', 8, 0, '2024-09-06 10:41:29', '2024-09-06 10:41:29'),
(264, 'e0d379dd-4fe4-47cc-876f-3e8d3eccc9d0', 810, '<p>Plan 03 has been approved </p><p>please share me the step files</p>', 9, 0, '2024-09-06 20:33:49', '2024-09-06 20:33:49'),
(265, 'c21e153a-7933-4ccb-8ad1-a42fb44da29f', 741, '<p>ERANJA PERIERA</p><p><br></p><p>DO 277 </p><p><br></p><p>REVISION 3</p><p><br></p><p>MAXILLARY ARCH</p><p>1. Distalize and distally rotate 17 by 1mm </p><p>2. Distalize and distally tip 16 by 1.5 mm to achieve class 1 molar relationship on the right upper posterior quadrant. </p><p>3. Distally tip 15 and 14 to get good posterior intercuspation with lower right posterior teeth</p><p>4. Do IPR in distal of 13,14,15 upto 0.5mm each tooth. Space gained by IPR can be utilized to achieve distalization of 15,14,13 to get good posterior intercuspation with lower right posterior teeth and achieve class 1 molar and class I canine relationship on the right quadrant</p><p>5. Match the incisal edge of 11 with that of 21</p><p>&nbsp;</p><p>LOWER ARCH</p><p>&nbsp;</p><p>1. Do IPR in distal of 43,44,45 upto 0.5mm each tooth to mesialize 44,45 and 46 to achieve class 1 molar and class 1 canine relationship in the right lower posterior quadrant</p><p>2. Incorporate buccal crown torque in 36 and 37 to get good intercuspation with 26 and 27</p>', 8, 0, '2024-09-07 15:45:30', '2024-09-07 15:45:30');
INSERT INTO `cases_status_users_comments` (`id`, `guid`, `pcsu_id`, `comments`, `case_status`, `status`, `created_at`, `updated_at`) VALUES
(266, '988ac302-6019-456d-aa86-fcf7e5e8fdbf', 795, '<p>Make it 14 U&amp;L</p>', 8, 0, '2024-09-07 15:57:03', '2024-09-07 15:57:03'),
(267, '87397cba-5545-498c-aac2-3d0afb600440', 817, '<p>DIMUTHU PRAMILA</p><p>DO 278 </p><p>REVISION 1</p><p>In addition to the existing simulation plan add the following suggestions</p><p>MAXILLARY ARCH</p><p>1. Do IPR in distal of 13,14,15 upto 0.5mm each tooth. 1.5 space can be utilized to correct crowding in the upper anterior teeth and upper incisor proclination</p><p>2. Distalize and distally rotate 27 and 26 by 2 mm to achieve class 1 molar relationship on the left upper posterior quadrant.</p><p>2.Do IPR in distal of 23,24 upto 0.5mm. 1.5 space can be utilized to correct crowding in the upper anterior teeth, intercuspation in the posterior teeth and upper incisor proclination</p><p>3. Maxillary arch expansion as needed to correct crowding and proclination </p><p>&nbsp;</p><p>LOWER ARCH</p><p>&nbsp;</p><p>1. Do IPR in distal of 31,32, and 41,42 upto 0.5mm each tooth. &nbsp;2mm space gained by IPR can be utilized to address the lower anterior crowding and black triangle in the lower incisors</p><p>2. Do IPR in distal of 33,34,35 upto 0.5mm each tooth. 1.5mm space can be utilized to achieve good posterior intercuspation, &nbsp;correct crowding and proclination of lower anterior teeth</p><p>3. Do IPR in distal of 43,44,45 upto 0.5mm each tooth. 1.5mm space can be utilized to correct crowding and proclination of lower anterior teeth</p><p>4. Mandibular arch expansion as needed to correct crowding and proclination </p><p>&nbsp;</p>', 8, 0, '2024-09-07 16:17:53', '2024-09-07 16:17:53'),
(268, 'fa6c1221-b958-4176-a569-cf5e7549f6c3', 818, '<p>case has been approved please send the IPR and the Step files.</p>', 9, 0, '2024-09-07 16:48:24', '2024-09-07 16:48:24'),
(269, 'fd8d4efe-d5b7-45ed-817c-4b77a5779460', 826, '<p>NIRANJALA DILINI</p><p><br></p><p>DO 279 </p><p><br></p><p>In addition to the existing simulation plan add the following suggestions</p><p>REVISION 1</p><p><br></p><p>MAXILLARY ARCH</p><p><br></p><p>1. Incorporate 1mm of intrusion in the upper teeth with retracting the upper anterior teeth</p><p>LOWER ARCH</p><p><br></p><p>1. Incorporate 1mm of intrusion in the upper teeth with retracting the lower anterior teeth</p><p>OVERALL</p><p><br></p><p>1. Achieve ideal overbite</p><p>&nbsp;</p>', 8, 0, '2024-09-08 13:16:35', '2024-09-08 13:16:35'),
(270, '8423b78b-d613-4ecc-9300-13a77d2b188b', 717, '<p>VISHANI LAKMA</p><p><br></p><p>DO 280</p><p> </p><p>Revision of plan 2</p><p><br></p><p>In addition to the existing simulation plan add the following suggestions</p><p><br></p><p>MAXILLARY ARCH</p><p>1. Improvise intercuspation and occlusion of 17 with 47, 26 with 36 and 27 with 37</p><p>2. Do IPR in distal of 12,13,14,15 upto 0.5mm each tooth. 2mm space gained by IPR can be utilized to achieve retraction of upper anterior teeth and proclination correction</p><p>3. Do IPR in distal of 22,23,24,25 upto 0.5mm each tooth. 2mm pace gained by IPR can be utilized to achieve retraction of upper anterior teeth and proclination correction</p><p>4. Achieve ideal overjet and overbite</p><p>5. Maintain the achieved intrusion of upper anterior teeth from the previous treatment plan</p><p>6. Improvise the Class 1 canine relationship between 13 and 43 &amp; 23 and 33</p><p><br></p><p>MANDIBULAR ARCH</p><p>1. Do IPR in distal of 31,32, and 41,42 upto 0.5mm each tooth. &nbsp;2mm space gained by IPR can be utilized to address the lower anterior crowding and black triangle in the lower incisors</p><p>2. Do IPR in distal of 33,34,35 upto 0.5mm each tooth. 1.5mm space can be utilized to achieve good posterior intercuspation, &nbsp;correct crowding and proclination of lower anterior teeth</p><p>3. Do IPR in distal of 43,44,45 upto 0.5mm each tooth. 1.5mm space can be utilized to achieve good posterior intercuspation correct crowding and proclination of lower anterior teeth</p>', 8, 0, '2024-09-09 01:18:29', '2024-09-09 01:18:29'),
(271, '13347fcc-6fd4-4ef0-8c89-018567040b24', 827, '<p>GAYESHA DANAJANI</p><p><br></p><p>DO 281 </p><p><br></p><p>Revision 1</p><p><br></p><p>In addition to the existing simulation plan add the following suggestions</p><p><br></p><p>MAXILLARY ARCH</p><p>1. Distally upright 15 to get good intercuspation between 45 and 46</p><p>2. Distally upright 25 to get good intercuspation between 35 and 36</p><p>3. Do IPR in distal of 13,14,15 upto 0.5mm each tooth. 1.5mm space gained by IPR can be utilized to achieve retraction of upper anterior teeth and proclination correction</p><p>4. Do IPR in distal of 23,24,25 upto 0.5mm each tooth. 1.5mm pace gained by IPR can be utilized to achieve retraction of upper anterior teeth and proclination correction</p><p>5. Achieve ideal overjet and overbite</p><p><br></p><p>MANDIBULAR ARCH</p><p>&nbsp;1. Do IPR in distal of 31,32, and 41,42 upto 0.5mm each tooth. &nbsp;2mm space gained by IPR can be utilized to address the lower anterior crowding and black triangle in the lower incisors</p><p>2. Do IPR in distal of 33,34,35 upto 0.5mm each tooth. 1.5mm space can be utilized to achieve good posterior intercuspation, correct crowding and proclination of lower anterior teeth</p><p>3. Do IPR in distal of 43,44,45 upto 0.5mm each tooth. 1.5mm space can be utilized to achieve good posterior intercuspation correct crowding and proclination of lower anterior teeth</p><p>4. Correct mesiobuccal rotation of 37 to get good intercuspation with 27</p><p>5. Correct mesiobuccal rotation of 47 to get good intercuspation with 17</p>', 8, 0, '2024-09-09 01:43:57', '2024-09-09 01:43:57'),
(272, '59046f73-3e44-4396-b1f1-c5fc56d9f9b9', 828, '<p>Plan 02 has been approved </p><p>please share me the step files </p>', 9, 0, '2024-09-09 14:13:25', '2024-09-09 14:13:25'),
(273, '0326c1b0-c59e-4c28-8633-09b0a5b406ee', 833, '<p><span style=\"color: black;\">NAMAL BANDARA</span></p><p><br></p><p>DO 285 </p><p><br></p><p>Revision 1</p><p><br></p><p>In addition to the existing simulation plan add the following suggestions</p><p><br></p><p>MANDIBULAR ARCH</p><p><br></p><p>1. Distalize 45,44,43 by 1mm to get good intercuspation and occlusion with upper posterior teeth</p><p>2. Do IPR in distal of 43 upto 0.5 mm to distalize 43 (canine) and do IPR mesial of 43 upto 0.25mm</p><p>3. Do IPR in mesial of 42, 41 upto 0.5mm each tooth. </p><p>4. Do IPR in distal of 31 and mesial of 32 upto 0.5mm each tooth.</p><p>5. IPR done in 43,42,41,31,32 can be utilized to correct the lower dental midline shifted to patient left to match with the maxillary dental midline</p><p>6. Mesialize 33,34,36 to get good intercuspation with the upper posterior teeth</p>', 8, 0, '2024-09-09 16:44:50', '2024-09-09 16:44:50'),
(274, '987ac62d-c2c2-4130-a433-05522ad3b96b', 834, '<p><span style=\"color: black;\">FOWZANA FAROOK</span></p><p><br></p><p>DO 294 </p><p><br></p><p>Revision 1</p><p><br></p><p>In addition to the existing simulation plan add the following suggestions</p><p><br></p><p>MANDIBULAR ARCH</p><p><br></p><p>1. Distalize 45,44,43 by 1mm to get good intercuspation and occlusion with upper posterior teeth</p><p>2. Do IPR in distal of 44, 43,42,41 upto 0.5 mm each tooth to correct the lower dental midline shifted to patient left to match with the maxillary dental midline and correct black triangles</p><p>3. Do IPR in distal of 32 and mesial of 34 upto 0.5mm each tooth to mesialize 33 and 34</p><p>4. Expansion in the upper posterior teeth 17 and 27 to get good intercuspation with the lower posterior teeth (Terminal molars) to correct the posterior crossbite</p><p>5. Expand and improve intercuspation of 16 with the lower right terminal molar</p><p><br></p><p>MAXILLARY ARCH</p><p><br></p><p>1. Distalize 24,23,22 to get good intercuspation and occlusion with lower posterior quadrant and reduced the overjet</p><p>2. Lingual incline and constrict the lower terminal molar to correct posterior crossbite</p><p><br></p><p>OVERALL</p><p>1. Reduce the resulting overjet</p>', 8, 0, '2024-09-09 17:05:59', '2024-09-09 17:05:59'),
