(288, '17467dd2-69c6-4a60-9080-276d69822ba6', 833, '<p><span style=\"background-color: rgb(245, 245, 245);\">MANDIBULAR ARCH</span></p><p><br></p><p><span style=\"background-color: rgb(245, 245, 245);\">1. Incisal edge of mandibular incisors are not evenly levelled. (Frontal view) Kindly align them</span></p><p><span style=\"background-color: rgb(245, 245, 245);\">2. Can mandibular dental midline still improved and matched with maxillary dental midline</span></p>', 8, 0, '2024-09-13 23:57:39', '2024-09-13 23:57:39'),
