(307, 'c5caffa5-f570-482b-8fbd-31cfcfa90981', 1100, '<p>Hello all, </p><p>Thank for the simulation.Would you please make these changes :</p><p>-Try not to increase the overjet .keep it the same as initial or less than that .</p><p>try to center the midline using unilateral stripping .</p><p>-If there is a spaces left on lower jaw ,just make mesialisation .</p><p>Thank you </p>', 8, 0, '2024-09-23 04:04:55', '2024-09-23 04:04:55'),
