(312, '021bc0bc-dee6-4d90-b2b6-619185440855', 1132, '<p>AMODHYA SANJEEWANI</p><p><br></p><p>D0306</p><p><br></p><p>UPPER ARCH</p><p>1. Mesiobuccal rotation of 16 and maintain the 16 occlusion and intercuspation with 46</p><p>2. Improve intercuspation and occlusion of 15 with 45 and 46</p><p>3. Improve intercuspation and occlusion of 14 with 44 and 45</p><p>4. &nbsp;Improve intercuspation and occlusion of 24 with 34 and 35</p><p>5. Do IPR distal of 13,14,15 to reduce overjet</p><p>6. Using IPR in 13,14,15 to improve posterior occlusion</p><p>7. Do IPR distal of 23,24,25 to reduce overjet</p><p>8. Using IPR in 23,24,25 to improve posterior occlusion</p><p>9. Improve class 1 canine relationship of 13 with 43 and 23 with 33</p><p><br></p><p>MANDIBULAR ARCH</p><p>1. Do IPR in distal of 42,41,31,32 upto 0.5mm an utilize the space to correct the lower dental midline to match with the maxillary dental midline and minimize black triangles</p><p>2. Do IPR upto 0.5mm in distal of 43 ,44,45 and mesial of 46 to get good intercuspation and occlusion with upper right posterior teeth</p><p>3. Do IPR upto 0.5mm in mesial of 33, 34,35 to get good intercuspation and occlusion with upper left posterior teeth</p>', 8, 0, '2024-09-24 10:23:49', '2024-09-24 10:23:49'),
(313, 'fa547bbb-c764-4bf3-8cb6-2e1eb0770a24', 1133, '<p>SANDARUWAN</p><p><br></p><p>D0307</p><p><br></p><p>UPPER ARCH</p><p><br></p><p>1. Mesiobuccal rotation correction in 12 and 22 to align the upper anterior teeth</p><p><br></p><p>LOWER ARCH</p><p>1. Incorporate buccal crown torque in 36 to improve intercuspation and occlusion with 26</p><p>2. Incorporate buccal crown torque in 46 to improve intercuspation and occlusion with 16</p><p>3. Incorporate buccal crown torque in 47 to improve intercuspation and occlusion with 17</p><p>4. Incorporate buccal crown torque in 33 to improve occlusion, canine guided occlusion and class 1 canine relationship with 23</p><p>5. Incorporate buccal crown torque in 43 to improve occlusion, canine guided occlusion and class 1 canine relationship with 13</p><p><br></p><p>NOTE: IPR as required in both the arches to level and align</p>', 8, 0, '2024-09-24 10:52:27', '2024-09-24 10:52:27'),
(314, '72e10d2a-bd42-4430-aadc-1a985cf6b6dd', 1134, '<p>Approved. Pls share step files inform on whatsapp group</p>', 9, 0, '2024-09-24 11:45:05', '2024-09-24 11:45:05'),
