(318, '714a47bc-6076-4f2c-95a1-e3275218d2a0', 1154, '<p>SEWWANDI SAMARASINGHA</p><p><br></p><p>D0309</p><p><br></p><p>In addition to the existing plan add the following corrections</p><p><br></p><p>UPPER ARCH</p><p>1. 15 should have good intercuspation and occlusion with 44 and 45</p><p>2. 16 should have good intercuspation and occlusion with 45 and 46. Avoid excessive mesializaton of 16 and 17</p><p>3. 25 should have good intercuspation and occlusion with 34 and 35</p><p>4. 26 should have good intercuspation and occlusion with 35 and 36. Avoid excessive mesializaton of 26 and 27</p><p>5. Retraction of anterior teeth (Frogs protocol)</p><p><br></p><p>LOWER ARCH</p><p>1. Do IPR in 31,32,41,42 upto 0.5mm each tooth to retract the lower incisors and reduce the black triangles</p><p>2. Avoid proclination of lower anterior teeth, to avoid gingival recession in the lower anteriors </p><p>3. Level and align the incisal edge of the lower incisors</p><p>4. Reduce the mesiodistal restoration space of 43 by moving adjacent tooth, taking reference and measurement of 33 </p><p>5. Do IPR distal of 34,35 and 44,45 to upright the mandibular bicuspids to improve posterior occlusion. Avoid mesial tipping of mandibular bicuspids</p><p><br></p><p>OVER ALL</p><p>1. Achieve ideal overjet and overbite</p>', 8, 0, '2024-09-25 03:01:46', '2024-09-25 03:01:46'),
(319, 'f7559a3c-aa8c-4f98-8d2c-70fa16e84381', 1157, '<p>DILINIKA SEWWANDI</p><p><br></p><p>D0311</p><p>Single Arch treatment: Upper arch</p><p><br></p><p>In addition to the existing plan add the following corrections</p><p><br></p><p>UPPER ARCH</p><p><br></p><p>1. Do IPR distal to 14 and 15 upto 0.5mm each tooth to improve and settle for better occlusion and intercuspation with the lower right posterior teeth (44 and 45)</p><p>2. Upright 24 and 25 to have better occlusion and intercuspation with 34,35,36 respectively.</p><p>3. Do IPR in mesial of 12 and 22 upto 0.5mm each tooth to reduce the black triangle in the upper anterior teeth</p><p>4. 12 and 22, IPR space can be utilized for upper incisor intrusion</p><p><br></p>', 8, 0, '2024-09-25 03:55:29', '2024-09-25 03:55:29'),
(320, '2f431a59-8263-47b6-9ca9-35f8424292c6', 1194, '<p>Please export this case</p><p>ASAP</p><p><br></p>', 15, 0, '2024-09-25 21:38:13', '2024-09-25 21:38:13'),
