(322, '11267357-4450-4b7d-93fd-57fb36c90360', 1133, '<p>SANDARUWAN</p><p><br></p><p>D0307</p><p><br></p><p>Plan 2 - Revision </p><p><br></p><p>UPPER ARCH</p><p>1. Mesiolabial rotation correction in  22 to align the upper anterior teeth</p><p>2. 0.25mm intrusion in 22 to match with 12</p>', 8, 0, '2024-09-25 23:07:11', '2024-09-25 23:07:11'),
