(325, 'd0afad80-da13-4a68-a2c4-b254c9a57147', 1214, '<p>PRIYA SENEWIRATHNA</p><p><br></p><p>D0311</p><p><br></p><p>Revision 1</p><p><br></p><p>In addition to the existing plan add the following corrections</p><p><br></p><p>UPPER ARCH</p><p>1. Incisal edges of 11 and 21 are not matching. Align them</p><p>2. Incisal edge of 12 and 22 (Lateral incisors) should be 0.5mm above the incisal edges of 11 and 21 respectively</p><p>3. Eliminate the interference in the distal margin ridge of for complete mesiobuccal rotation correction of 45 to get better occlusion and intercuspation.</p><p>4. Distally upright the crown of 24 and 25 to have better occlusion and intercuspation with 34,35,36 respectively.</p><p><br></p><p><br></p><p>LOWER ARCH</p><p>1. Mesiobuccal rotation correction of 45 to get better occlusion and intercuspation with 14 and 15</p>', 8, 0, '2024-09-26 15:30:54', '2024-09-26 15:30:54'),
