(327, '5969fc2b-14ea-44cd-9c59-fc5da9815a47', 1216, '<p>Revise and do in reduced trays&nbsp;</p><p>Upper 10</p><p>Lower 10</p><p><br></p><p>And send revised plan&nbsp;</p><p><br></p>', 8, 0, '2024-09-26 15:52:09', '2024-09-26 15:52:09'),
(328, 'd1c38fb5-38af-4ab5-b8b0-51abc45a1cb5', 1219, '<p>Revise and do in reduced trays&nbsp;</p><p>Upper 32</p><p>Lower 16</p><p><br></p><p>And send revised plan&nbsp;</p><p><br></p>', 8, 0, '2024-09-26 18:39:43', '2024-09-26 18:39:43'),
(329, 'acb012c1-76ce-41da-b495-31ca3af4a62e', 1154, '<p>SEWWANDI SAMARASINGHA</p><p><br></p><p>D0309</p><p><br></p><p>Revision 2</p><p><br></p><p>In addition to the existing plan add the following corrections</p><p><br></p><p>UPPER ARCH</p><p>1. At aligner step (no 26), 15 has good intercuspation and occlusion with 44 and 45. Stop mesialization of 15 beyond this stage</p><p><br></p><p>2. Mesialize 16 to have good intercuspation and occlusion with 45 and 46. Avoid excessive mesializaton of 16 and 17</p><p><br></p><p>3. At aligner step (no 26), 25 has good intercuspation and occlusion with 34 and 35. Stop mesialization of 15 beyond this stage</p><p><br></p><p>4. Mesialize 26 to have good intercuspation and occlusion with 35 and 36. Avoid excessive mesializaton of 26 and 27</p><p><br></p><p>5. Rest of the space mesial to 15 and 25... Retract the upper anterior teeth to close the extraction spaces (Frogs protocol)</p>', 8, 0, '2024-09-27 06:03:10', '2024-09-27 06:03:10'),
(330, '554ea702-9364-4f4c-b396-08c933f6dcf9', 1157, '<p>D0311</p><p>Single Arch treatment: Upper arch</p><p><br></p><p>PLAN 1 is good. Just add the following correction in the upper arch</p><p><br></p><p>UPPER ARCH</p><p><br></p><p>1. Do IPR in mesial of 12 and 22 upto 0.5mm each tooth to reduce the black triangle in the upper anterior teeth</p><p>2. 12 and 22, IPR space can be utilized for upper incisor intrusion</p><p><br></p><p>Avoid this previous instructions mentioned below</p><p><br></p><p>1. Do IPR distal to 14 and 15 upto 0.5mm each tooth to improve and settle for better occlusion and intercuspation with the lower right posterior teeth (44 and 45)</p><p>2. Upright 24 and 25 to have better occlusion and intercuspation with 34,35,36 respectively.</p>', 8, 0, '2024-09-27 06:14:05', '2024-09-27 06:14:05'),
