(340, '3ae7a957-d0ac-40d9-8265-840e70286da1', 1157, '<p>UPPER ARCH</p><p><br></p><p>1. 14 should have good intercuspation and occlusion with 44 and 45</p><p>2. 15 should have good intercuspation and occlusion with 45</p><p>3. Do IPR distal of 14 and 15 upto 0.5mm each tooth for better occlusion and intercuspation with the lower right posterior teeth (44 and 45)</p><p>4. 24 should have good intercuspation and occlusion with 34 and 35</p><p>5. 25 should have good intercuspation and occlusion with 35 and 36</p><p>6. Do IPR in mesial of 12 and 22 upto 0.5mm each tooth to reduce the black triangle in the upper anterior teeth</p><p>7. 12 and 22, IPR space can be utilized for upper incisor intrusion</p><p><br></p><p><br></p>', 8, 0, '2024-09-30 14:57:49', '2024-09-30 14:57:49'),
(341, '36b3e538-2c1d-4bd2-868b-1ee714770a69', 1281, '<p>METHULI ANUDIMA</p><p><br></p><p>DO313</p><p><br></p><p>Revision 1</p><p><br></p><p>In addition to the existing simulation plan add the following suggestions</p><p><br></p><p>MAXILLARY ARCH</p><p>1. Do IPR in distal of 13,14,15 upto 0.5mm each tooth. 1.5mm space gained by IPR can be utilized to achieve good intercuspation and occlusion with lower right posterior teeth</p><p>2. Do IPR in distal of 23,24,25 upto 0.5mm each tooth. 1.5mm space gained by IPR can be utilized to achieve good intercuspation and occlusion with lower left posterior teeth</p><p>3. Improvise the Class 1 canine relationship between 13 and 43 &amp; 23 and 33</p><p>4. Proclination correction by retraction of the upper anterior teeth utilizing the IPR spaces</p><p><br></p><p>MANDIBULAR ARCH&nbsp;</p><p>1. Do IPR in distal of 31,32, and 41,42 upto 0.5mm each tooth.&nbsp;1.5mm space gained by IPR can be utilized to address the lower anterior crowding</p><p>2. Do IPR in mesial of 33,34,35 upto 0.5mm each tooth. 1.5mm space can be utilized to mesialize 34,35,36 and achieve good posterior intercuspation, correct crowding and proclination of lower anterior teeth</p><p>3. Do IPR in mesial of 43,44,45 upto 0.5mm each tooth. 1.5mm space can be utilized to mesialize 44,45,46 and achieve good posterior intercuspation, correct crowding and proclination of lower anterior teeth</p><p>4. Achieve Class 1 molar relationship between 16 with 46 &amp; 26 with 36</p><p><br></p><p>OVERALL</p><p>1. Achieve ideal overjet and overbite</p>', 8, 0, '2024-09-30 15:54:07', '2024-09-30 15:54:07'),
(342, '8eee1969-407d-4ace-b7cb-ef84f55bff95', 1288, '<p>Plan 02 </p>', 9, 0, '2024-09-30 20:51:40', '2024-09-30 20:51:40'),
