(346, 'd0846a05-3074-4720-ad78-1417833bebab', 1311, '<p>Hello,</p><p>We have done levelling and alignment.&nbsp;&nbsp;Maintained midline and overjet.&nbsp;However, we have maintained certain spaces to maintain class and overjet.&nbsp;&nbsp;</p><p>Please consider the above scenarios and let us know if you feel any discrepancy in the setup.</p><p>Thank you.</p>', 7, 0, '2024-10-01 23:53:05', '2024-10-01 23:53:05'),
