(348, '6d946d0c-76a1-440a-99c0-b5e72a4875e3', 1381, '<p>AMIRU BATHIKA</p><p><br></p><p>DO331</p><p><br></p><p>REVISION 1</p><p><br></p><p>MAXILLARY ARCH</p><p>1. Very mild mesiolabial rotation correction in 12 to alignment the maxillary incisors (Occlusal view)</p><p>2. Do IPR in distal of 13,14,15 upto 0.5mm each tooth. 1.5mm space gained by IPR can be utilized to achieve occlusion and good intercuspation with the lower right posterior teeth</p><p><br></p><p>LOWER ARCH</p><p>1. Do IPR in distal of 43,44,45 upto 0.5mm each tooth. 1.5mm space can be utilized to achieve good mesialize 44,45,46 to get good occlusion and good intercuspation with the upper right posterior teeth</p><p>2. Achieve class 1 molar relationship in 16 with 46</p><p>&nbsp;</p>', 8, 0, '2024-10-03 10:25:33', '2024-10-03 10:25:33'),
