(371, '263178ed-8266-4a9c-9ca2-149726b80797', 1587, '<h1>Maria Afzal: Reduce the upper incisors intrusions as much as possible and limit the case to the upper anterior alignment only. The attachment on the tooth 11 (RU1) is not straight and will be a problem while seating aligners.</h1><h1><br></h1><h2>Also do not retract the incisors. The intrusion is too much especially on the canines and won\'t be achievable in this case. Also, the incisors can be only intruded up to the level of the canines. Retraction is not possible in this case because of the biological limits.</h2><h2><br></h2><p> just align the arch and send</p><p>limit the aligners</p><h3>its already treated and relapse case</h3><p><br></p><p><br></p><p>these all modifications are from Dr Rashid also shared in group too with pictures</p>', 8, 0, '2024-10-08 03:27:10', '2024-10-08 03:27:10'),
