(380, 'd9305832-0d4d-475d-b194-a34f5348f811', 1662, '<p>Hello, </p><p>As requested to center the midline and close the space in upper arch which is approx 4-5mm. Closing this space along with centering midline is not possible. Please have a look and suggest further. </p><p>Thank you</p>', 4, 0, '2024-10-09 22:57:40', '2024-10-09 22:57:40'),
