(384, 'ec394953-010a-4deb-a9bf-0281c3f41da0', 1779, '<p>Thank you ,</p><p>Can give positive torque to the upper front while expansion lower front .because lower incisors start touching upper incisors by step 10 .</p><p>-close posterior spaces in the end by mesialisation .</p>', 8, 0, '2024-10-11 15:32:12', '2024-10-11 15:32:12'),
(385, '1bb3a83e-1578-4f1e-abab-40764c1aed5b', 1381, '<p>AMIRU BATHIKA</p><p><br></p><p>DO331</p><p><br></p><p>REVISION 2</p><p><br></p><p>Kindly reduce the number of aligner to 25 pairs in both the arches</p>', 8, 0, '2024-10-12 16:14:28', '2024-10-12 16:14:28'),
(386, 'a59fea4e-e168-4b88-9e0d-a385fd9d1c81', 1834, '<p><br></p><p>Sara Hettiarachi</p><p><br></p><p>D0304</p><p><br></p><p>Revision 1</p><p><br></p><p>In addition to the existing simulation plan add the following suggestions</p><p><br></p><p>MAXILLARY ARCH</p><p>1. Do IPR in distal of 13,14,15 upto 0.5mm each tooth. 1.5mm space gained by IPR can be utilized to achieve correction of proclination of the upper anterior teeth</p><p>2. Do IPR in distal of 23,24,25 upto 0.5mm each tooth. 1.5mm space gained by IPR can be utilized to achieve correction of proclination of the upper anterior teeth</p><p>3. Proclination correction by retraction of the upper anterior teeth utilizing the IPR spaces</p><p>&nbsp;</p><p>LOWER ARCH</p><p>&nbsp;</p><p>1. Do IPR in distal of 31,32, and 41,42 upto 0.5mm each tooth.&nbsp;1.5mm space gained by IPR can be utilized to correct the lower anterior crowding</p><p>2. Do IPR in distal of 33,34,35 upto 0.5mm each tooth. 1.5mm space can be utilized to correct crowding and proclination of lower anterior teeth</p><p>3. Do IPR in distal of 43,44,45 upto 0.5mm each tooth. 1.5mm space can be utilized correct crowding and proclination of lower anterior teeth</p><p><br></p><p>OVERALL</p><p>1. Achieve ideal overjet and overbite</p>', 8, 0, '2024-10-12 16:51:52', '2024-10-12 16:51:52'),
(387, '1ac5bb33-8169-4c36-846f-621e105b50cc', 1838, '<p><span style=\"color: black;\">Senadhi Wijesinghe</span></p><p>&nbsp;</p><p>Missing or extracted 41</p><p>&nbsp;</p><p><span style=\"color: black;\">Revision 1</span></p><p>&nbsp;</p><p><span style=\"color: black;\">D0327</span></p><p>&nbsp;</p><p>In addition to the existing simulation plan add the following suggestions</p><p><br></p><p>MAXILLARY ARCH</p><p>1. Do IPR in mesial of 13,14,15 upto 0.5mm each tooth. 1.5mm space gained by IPR can be utilized to mesialize 13,14,15,16 to achieve good posterior occlusion and intercuspation with the lower right posterior teeth</p><p>2. Do IPR in mesial of 23,24,25 upto 0.5mm each tooth. 1.5mm space gained by IPR can be utilized to mesialize 23,24,25,26 to achieve good posterior occlusion and intercuspation with the lower left posterior teeth</p><p>3. Achieve class 1 canine relationship of 13 with 33 and 23 with 33</p><p>4. Achive Class 1 molar relationship of 16 with 46 and 26 with 46</p><p>5. correction of proclination by retraction of the upper anterior teeth utilizing the IPR spaces</p><p>&nbsp;</p><p>MANDIBULAR ARCH</p><p>&nbsp;</p><p>Missing or extracted 41</p><p>&nbsp;</p><p>1. Do IPR in distal of 31,32, and 42 upto 0.5mm each tooth.&nbsp;1.5mm space gained by IPR can be utilized to correct the lower anterior crowding and black triangles</p><p>2. Do IPR in distal of 33,34,35 upto 0.5mm each tooth. 1.5mm space can be utilized to achieve good posterior occlusion and intercuspation with the left upper posterior teeth and proclination of lower anterior teeth</p><p>3. Do IPR in distal of 43,44,45 upto 0.5mm each tooth. 1.5mm space can be utilized to achieve good posterior occlusion and intercuspation with the right upper posterior teeth and proclination of lower anterior teeth</p><p><br></p><p>OVERALL</p><p>1. Achieve ideal overjet and overbite</p>', 8, 0, '2024-10-12 17:36:56', '2024-10-12 17:36:56'),
(388, 'd5e4dace-ec38-494b-95c2-bf3785f3b64b', 1897, '<p>Please correct the midline to match the lip</p>', 8, 0, '2024-10-13 15:47:20', '2024-10-13 15:47:20'),
(389, '6896997b-6507-4d72-aea8-113dfa2a81ba', 1899, '<p><span style=\"color: black;\">Senadhi Wijesinghe</span></p><p>&nbsp;</p><p><span style=\"color: black;\">Revision 2</span></p><p>&nbsp;</p><p><span style=\"color: black;\">D0327</span></p><p><br></p><p>MAXILLARY ARCH</p><p><br></p><p>1. Eliminate IPR in the upper incisors (!2,11,21,22)</p><p>2. Achieve class 1 canine relationship of 13 with 43 and 23 with 33</p><p><br></p><p>MANDIBULAR ARCH</p><p>&nbsp;</p><p>1. Do IPR in distal of 33,34,35 upto 0.5mm each tooth. 1.5mm space can be utilized to achieve good posterior occlusion and intercuspation with the left upper posterior teeth </p><p>2. Do IPR in distal of 43,44,45 upto 0.5mm each tooth. 1.5mm space can be utilized to achieve good posterior occlusion and intercuspation with the right upper posterior teeth </p><p>3.Retraction of lower anterior teeth with IPR space</p><p>4.Achieve class 1 canine relationship of 13 with 43 and 23 with 33</p>', 8, 0, '2024-10-13 19:45:00', '2024-10-13 19:45:00'),
(390, 'd120eb13-2cf9-4e27-86d2-88d592973b97', 1901, '<p><span style=\"color: black;\">Pavithra Shehani</span></p><p>&nbsp;</p><p><span style=\"color: black;\">D0314</span></p><p>&nbsp;</p><p><span style=\"color: black;\">Revision 1</span></p><p>&nbsp;</p><p>In addition to the existing simulation plan add the following suggestions</p><p><br></p><p>MAXILLARY ARCH</p><p>1. Do IPR in distal of 23,24,25 upto 0.5mm each tooth. 1.5mm space gained by IPR can be utilized to distalize 23,24,25 to achieve good posterior occlusion and intercuspation with the lower left posterior teeth</p><p>2. Distalize 13 to achieve achieve class 1 canine relationship with 43. 13 should get good intercuspation and occlusion between 43 and 44</p><p>3. Space gained by IPR in mesial to 23,24,25 can be utilized to reduce the overjet</p><p>4. Space gained by distalizing 13, mesial to 13 can be utilized to reduce the overjet</p><p><br></p><p>LOWER ARCH</p><p>1. Do minimal IPR in distal of 31,32,41 42 upto 0.25mm in each tooth.&nbsp;1mm space gained by IPR can be utilized to mesialize 33 to achieve class 1 canine relationship between 23 and 33</p><p>2. Do IPR in mesial of 33,34,35 upto 0.5mm each tooth. 1.5mm space can be utilized to mesialize 34,35,36 and achieve good posterior occlusion and intercuspation with the left upper posterior teeth </p><p>3. Incorporate button cut outs in 23 and 26 to reinforce anchorage for distalization of 23,24,25 and mesialization of 34,35,36</p><p><br></p><p>OVER ALL</p><p>1. Correction of upper dental midline shifted to match with the lower dental midline</p><p>2. Achieve optimal overjet and over bite.</p>', 8, 0, '2024-10-14 06:02:09', '2024-10-14 06:02:09'),
(391, '7b26cb2a-d862-418f-8414-7ee57865e7f0', 1902, '<p><span style=\"color: black;\">Thilini Jayawardane</span></p><p>&nbsp;</p><p><span style=\"color: black;\">D0248</span></p><p>&nbsp;</p><p><span style=\"color: black;\">Revision 1</span></p><p>&nbsp;</p><p>In addition to the existing simulation plan add the following suggestions</p><p><br></p><p>UPPER ARCH</p><p>1. Incorporate 10-degree palatal root torque in 12,11,21,22 while retracting maxillary anterior teeth. Avoid over retraction of maxillary incisors causing retroclination</p><p>2. Distobuccal crown rotation of 27 to correct the crossbite with 37 to improve occlusion</p><p><br></p><p>LOWER ARCH</p><p>1. Incorporate buccal crown torque in 33,34,35 to get good occlusion and intercuspation with left upper posterior teeth</p><p>2. Incorporate buccal crown torque in 43,44,45 to get good occlusion and intercuspation with right upper posterior teeth</p><p>3. Can IPR be minimized in the lower arch by utilizing arch expansion and buccal crown torque in posterior teeth</p><p>4. Distolingual crown rotation of 37 to correct the crossbite with 27 to improve occlusion</p><p>&nbsp;</p>', 8, 0, '2024-10-14 06:25:57', '2024-10-14 06:25:57'),
