(397, '964f1cb4-7e9b-456a-9925-1af4e9c3d442', 1964, '<p>Revision 3</p><p><br></p><p>Add the following corrections to the existing treatment plan</p><p>1. Incorporate button cutouts in 16,26,33,43</p><p>2. Button cut outs for bonding buttons to reinforce anchorage between16 and 43 &amp; between 26 and 33.</p>', 8, 0, '2024-10-15 15:21:08', '2024-10-15 15:21:08'),
