(531, 'a132d520-1931-45db-bd8b-c494682af7ee', 4092, '<p>DILMI ATHPATHU</p><p><br></p><p><br></p><p> </p><p>D0240</p><p><br></p><p> </p><p>EXPECTED CORRECTIONS FROM 14 UPPER ALIGNER/ 14 LOWER ALIGNERS</p><p> </p><p>UPPER ARCH</p><p>1. Distalize and distally rotate 16,15,14,13 to get proper posterior intercuspation in the right posterior quadrant</p><p>2. Distalize and distally rotate 26,25,24,23 to get proper posterior intercuspation in the right posterior quadrant</p><p>3. IPR distal of 11,12,13,14,15 and 21,22,23,24,25. Space gained can be utilized to reduced the overjet</p><p>quadrant</p><p> </p><p>LOWER ARCH</p><p>1. IPR in lower anterior 43,42,41,31,32,33 upto 0.5mm. 3mm space can be utilized to mesialize 34,35 and 44,45 to get occlusion and proper intercuspation of the lower posterior with upper posterior teeth.</p><p>2. IPR mesial of 34,35,44,45 upto 0.5mm. 2mm space can utilized to mesialize 34,35 and 44,45 to get occlusion and proper intercuspation of the lower posterior with upper posterior teeth.</p><p><br></p><p> </p><p>OVER ALL</p><p>1. Achieve ideal overjet and overbite</p><p>2. Achieve good posterior occlusion and intercuspation</p>', 8, 0, '2024-11-14 17:03:02', '2024-11-14 17:03:02'),
(532, 'd04a1911-e788-41fd-8dc2-4184251eeaf8', 4100, '<p>Hello Doctor,</p><p>We have done levelling and alignment. We have done distalization and mesialization for ideal overjet and overbite&nbsp;with that, we have added ipr and extracted all 8s . Derotated the&nbsp;teeth. Achieved good posterior occlusion and intercuspation.</p><p>Please consider the above scenarios and let us know if you feel any discrepancy in the setup. </p><p>Thank you</p>', 7, 0, '2024-11-15 00:58:59', '2024-11-15 00:58:59'),
(533, 'c71e1094-62c5-4159-ad90-c2a7c334e734', 4103, '<p>HANSIKA SENARATHNA</p><p><br></p><p> </p><p>DO363 </p><p><br></p><p><br></p><p><br></p><p><br></p><p> </p><p>Revision 2 </p><p> </p><p>UPPER ARCH</p><p>1. IPR upto 0.5mm in distal of 23,24,25 to distalize 23 to achieve proper class 1 canine relationship with 33</p><p>2. 1.5mm gained by IPR can be utilized to correct the maxillary dental midline match with the mandibular dental midline</p><p>3. Intrude the maxillary incisors (12,11,21,22) upto 1.5mm</p><p> </p><p>LOWER ARCH</p><p>1. IPR in distal of 31,32 upto 0.5mm and mesial of 33,34,35 upto 0.5mm. This space can be utilized to mesialize 33,34,35 to get occlusion and proper intercuspation of the lower posterior with upper posterior teeth.</p><p>2. Lower arch can be expanded to gain space for correction of crowding in the lower anterior teeth and match maxillary dentition for good posterior occlusion</p><p> </p><p>OVER ALL</p><p>1. Achieve ideal overjet and overbite</p><p>2. Achieve good posterior occlusion and intercuspation</p>', 8, 0, '2024-11-15 04:08:26', '2024-11-15 04:08:26'),
