(100, '3bc277fd-25ef-413a-aae1-c8fa86e94cd7', 106, 'a6tBg6jH41eaCrrOcBOM.pdf', 'https://treatmentplan.xyz/onyx/Viewer/show.html?mlink=https://treatmentplan.xyz/onyx/Client4745/D0239-Dr.SARANGA%20PATIENT/26526CBE79084B36A91BF023FFF66A35.iiwgl&fg=000&bg=fff&p=BNWHDJ', '<p>Hello Dr,</p><p><br></p><p>We have levelled and aligned upper and lower teeth and resolved crowding and rotations by doing expansion and IPR.</p><p><br></p><p>Anterior spaces are closed after alignment is finished.&nbsp;</p><p><br></p><p>In doing so protrusion and overjet has been improved.&nbsp;</p><p><br></p><p>For IPR, please refer to per attached.</p><p><br></p><p>This case will take 14 Steps for Upper and 14 Steps for Lower.</p><p><br></p><p>Thank you.</p><p><br></p>', 0, 37, '2024-08-20 21:25:05', '2024-08-20 21:25:05'),
(101, 'd0e76e7d-5454-4b67-9472-c6000946da5b', 111, 'bsYPCOu1quHw5fDHYLzF.pdf', 'https://treatmentplan.xyz/onyx/Viewer/show.html?mlink=https://treatmentplan.xyz/onyx/Client4745/D0243-R%20S%20JAYAWARDHANA/2410E947D3F04B0C8CBF4DCB6D9892AD.iiwgl&fg=000&bg=fff&p=JLSWEH', '', 0, 37, '2024-08-20 22:06:36', '2024-08-20 22:06:36'),
(102, 'a95c750d-8371-4d64-b572-3b4daa2c5609', 110, '1qzSYpYYSJCt1uM8nH7l.pdf', 'https://treatmentplan.xyz/onyx/Viewer/show.html?mlink=https://treatmentplan.xyz/onyx/Client4745/D0242-AMIR%20HUZAIR/6FE9C4C31E5C4E06A587804E7C9F8278.iiwgl&fg=000&bg=fff&p=VEFJCE', '<p>Hello Dr,</p><p><br></p><p>We have levelled and aligned upper and lower teeth and resolved crowding and rotations by doing expansion and IPR.</p><p><br></p><p>Anterior spaces are closed after alignment is finished.&nbsp;</p><p><br></p><p>In doing so protrusion and overjet has been improved.&nbsp;</p><p><br></p><p>For IPR, please refer to per attached.</p><p><br></p><p>Apply pressure point on tooth 12,13,21,22,23 from step 1 till STEP 15.</p><p><br></p><p>Please apply bite ramps on teeth 36 and 46 from step 1 till the end of treatment.</p><p><br></p><p>This case will take 22 Steps for Upper and 22 Steps for Lower.</p><p><br></p><p>Thank you.</p>', 0, 37, '2024-08-21 01:23:53', '2024-08-21 01:23:53'),
