(117, '578d049c-5bf2-48c6-8970-c177e78ea515', 118, '83BOwRC16EzkooXU4SLM.pdf', 'https://treatmentplan.xyz/onyx/Viewer/show.html?mlink=https://treatmentplan.xyz/onyx/Client4745/D0250-Tharushi%20Nirmani/4EEE0B0AF6D642019E0D5A84785BDB77.iiwgl&fg=000&bg=fff&p=MRQLXI', '<p>Hello Dr,</p><p><br></p><p>We have levelled and aligned upper and lower teeth and resolved crowding and rotations by doing expansion and IPR.</p><p><br></p><p>Anterior spaces are closed after alignment is finished.&nbsp;</p><p><br></p><p>In doing so protrusion and overjet has been improved.&nbsp;</p><p><br></p><p>For IPR, please refer to per attached.</p><p><br></p><p>Apply pressure point on tooth 12,31,32,41,42 from step 1 till STEP 22.</p><p><br></p><p>Please apply bite ramps on teeth 36 and 46 from step 1 till the end of treatment.</p><p><br></p><p>This case will take 29 Steps for Upper and 26Steps for Lower.</p><p><br></p><p>Thank you.</p><p><br></p>', 0, 37, '2024-08-22 20:30:40', '2024-08-22 20:30:40'),
