(240, '298a3d61-7136-419c-ae1a-9dc26a1cebb6', 159, '', '', '<p>D0285</p><p>We have done levelling and alignment. We have done max ipr. However, the lower midline is not coincided with the upper midline . Along with that, if we distalize it, it will disturb the class.&nbsp;</p><p>Please consider the above scenarios and let us know if you feel any discrepancy in the setup Thankyou</p>', 0, 1, '2024-09-14 18:43:23', '2024-09-14 18:43:23'),
