(243, 'ee517044-ebe9-44f0-8d34-393e5f811520', 200, '', '', '<p>We need an x-ray(OPG) for this case. As the extraction mentioned in this case is&nbsp;33 ( which we assume is a decidous tooth) however we need extraction for lower right side to treatment, severe crowding, and out of arch tooth.</p><p>Please consider the above scenarios and let us know .</p><p>Thankyou</p>', 0, 37, '2024-09-16 19:12:56', '2024-09-16 19:12:56'),
(244, 'bf691301-29ee-46d8-8e46-ff206f3b0ce5', 201, 'FDEMXOEFcztVmcgkqjI4.pdf', 'https://treatmentplan.xyz/onyx/Viewer/show.html?mlink=https://treatmentplan.xyz/onyx/Client4745/D0172-akshaya-amodini/54602D41EBAC426A9E98CA0C02B9B9B6.iiwgl&fg=000&bg=fff&p=SKEDDH', '', 0, 1, '2024-09-16 20:42:55', '2024-09-16 20:42:55'),
(245, '9d71e589-bb48-47cc-beb3-4f50c4278176', 203, '0wlvLI4ZIVaabBLZJ4ia.pdf', 'https://treatmentplan.xyz/onyx/Viewer/show.html?mlink=https://treatmentplan.xyz/onyx/Client4745/D0314-Pavithra%20Shehani/BE886F3FA54A4D46ACAF81C44D772C72.iiwgl&fg=000&bg=fff&p=SXLWUY', '<p>Hello,</p><p>We have reduced protrusion by adding ipr. Maintained midline as well. However, the overjet is still increased due to the unavailability of extraction, and 25 is rotated, we can not derotate it because of the&nbsp;excessive movement .</p><p>Please consider the above scenarios and let us know if you feel any discrepancy in the setup Thankyou</p>', 0, 40, '2024-09-16 23:58:29', '2024-09-16 23:58:29'),
(246, '5f228005-2ccd-4402-bce4-7be59e71d496', 202, '5adJfN0otBivhT1BL4Jr.pdf', 'https://treatmentplan.xyz/onyx/Viewer/show.html?mlink=https://treatmentplan.xyz/onyx/Client4745/D0313-Methuli%20Anudima/7E6AA9535D1941B38105B2F6B3577F9C.iiwgl&fg=000&bg=fff&p=NGTLTU', '', 0, 40, '2024-09-17 03:25:36', '2024-09-17 03:25:36'),
(247, 'ce48b56c-8527-4b21-9a31-4979b898c879', 52, '', '', '', 0, 37, '2024-09-17 04:43:53', '2024-09-17 04:43:53'),
(248, '84339a65-6743-4f12-9e2b-20653e6a6f2a', 204, 'sPnJmPrlGdBGCIKFry4n.pdf', 'https://treatmentplan.xyz/onyx/Viewer/show.html?mlink=https://treatmentplan.xyz/onyx/Client4745/AJ032-Jana%20mheisen/F9488C46F95C4B538668F8AA23CA6E37.iiwgl&fg=000&bg=fff&p=QAKYKE', '<p>Hello Dr,</p><p><br></p><p>We have levelled and aligned upper and lower teeth and resolved crowding and rotations by doing expansion and IPR.</p><p><br></p><p>Anterior spaces are closed after alignment is finished.&nbsp;</p><p><br></p><p>In doing so protrusion and overjet has been improved.&nbsp;</p><p><br></p><p>For IPR, please refer to per attached.</p><p><br></p><p>This case will take 26 Steps for Upper and 26 Steps for Lower.</p><p><br></p><p>Apply pressure point on tooth 32 from step 1 till step 13.</p><p><br></p><p>Apply pressure point on tooth 11,12,13,21,22,23,33,42,43 from step 1 till step 20.</p><p><br></p><p>Thank you.</p>', 0, 37, '2024-09-17 08:53:15', '2024-09-17 08:53:15'),
