(1059, '54fb2023-4075-41d6-9057-0e597a63908c', 904, '', '', '<p>We have done levelling and alignment.&nbsp;Expanded arch by 2mm. Added pontic in 15 and 25 for the passive eruption of teeth. After alignment, we have intruded upper and&nbsp;lower anteriors by 2mm. Optimized attachments as well. Matched upper and lower midline. Levelled the curve of spee by extrusion of posteriors . Please consider the above scenarios and let us know if you feel any discrepancy in the setup Thankyou</p>', 0, 37, '2024-11-11 21:31:44', '2024-11-11 21:31:44'),
(1060, '9d0018b6-c3be-4d67-bfff-84fb52b255f2', 885, '', 'https://we.tl/t-yYrEJTigqv', '', 0, 122, '2024-11-11 22:48:33', '2024-11-11 22:48:33'),
(1061, '1a7b4c97-415a-4ce5-a9e6-13631361ffc5', 864, 'p0156.pdf_tD62rngVQ4.pdf', 'https://treatmentplan.xyz/onyx/Viewer/show.html?mlink=https://treatmentplan.xyz/onyx/Client4745/P0156-Richa%20Walia/90ED04DCCFBC4F81AFCBA412316C85F4.iiwgl&fg=000&bg=fff&p=EBWOAP', '', 0, 40, '2024-11-11 23:03:19', '2024-11-11 23:03:19'),
(1062, '81c7ca0c-4c45-4bf6-a63c-622165861c0a', 903, 'SZ009.pdf_o1OWJy7dBC.pdf', 'https://treatmentplan.xyz/onyx/Viewer/show.html?mlink=https://treatmentplan.xyz/onyx/Client4745/SZ009-Liana%20Kuznetsova/74A87EDC0CC440638E50260BD8DCA39F.iiwgl&fg=000&bg=fff&p=OABMYD', '<p>We have done levelling and alignment . Expanded upper and lower arch 2mm. Derotated posteriors,&nbsp;uae the space creates as well. Proclined&nbsp;upper and lower anteriors. Intruded them 2mm. Levelled curve of spee in lower arch.&nbsp;Didn\'t match no. Of aligners.&nbsp;However, due to the unavailability of ipr, we have not centred the midline but improved it.</p><p>Please consider the above scenarios and let us know if you feel any discrepancy in the setup. Thank you</p>', 0, 37, '2024-11-11 23:03:53', '2024-11-11 23:03:53'),
(1063, '1abb06ec-627c-4cdc-b0e8-b324f29e2729', 907, 'SZ013.pdf_xX8JXvQlFZ.pdf', 'https://treatmentplan.xyz/onyx/Viewer/show.html?mlink=https://treatmentplan.xyz/onyx/Client4745/SZ013-Evi%20Edgecombe/49971146A3CA47B0A91F0BEEF2F80991.iiwgl&fg=000&bg=fff&p=DKGFPO', '<p>We have done levelling and alignment.&nbsp;Expanded the arch as mentioned. Derotated posteriors. Extracted 14 and shifted upper midline to the right to match lower midline. Proclined upper and lower anteriors and intruded them 1mm after the alignment. We have levelled curve of spee on lowers by extrusion of posteriors. No. Of aligners are not matching in both arches. Overjet is positive .</p><p>Please consider the above scenarios and let us know if you feel any discrepancy in the setup Thankyou</p>', 0, 37, '2024-11-11 23:19:18', '2024-11-11 23:19:18'),
