(1114, 'da431461-04b3-49c1-95c5-e4b189b954dc', 848, 'D0416(PLAN 3) (1).pdf_1jcZwxbwru.pdf', 'https://treatmentplan.xyz/onyx/Viewer/show.html?mlink=https://treatmentplan.xyz/onyx/Client4745/D0416-PIUMIKA%20HETTIARACHCHI/E359374ACADD47E2BCCAD2E29D04DAA8.iiwgl&fg=000&bg=fff&p=WASLMO', '<p>Hi,</p><p>The movements in the upper arch are extensive, so they are not completed in 16 sets . We have completed the upper in 19 and lower in 26 as mentioned.&nbsp;</p><p>Please consider the above scenarios and let us know if you feel any discrepancy in the setup.</p><p> Thankyou</p>', 0, 54, '2024-11-12 22:48:59', '2024-11-12 22:48:59'),
(1115, 'd5128650-ee0f-4efb-a8a5-23233ab4ef91', 443, 'D0375.pdf_52yyoaJR48.pdf', 'https://treatmentplan.xyz/onyx/Viewer/show.html?mlink=https://treatmentplan.xyz/onyx/Client4745/D0375-Irushi%20Hapuarachi/AC0733BA27674AEBA73820F3ACDCE3F8.iiwgl&fg=000&bg=fff&p=DHASAE', '<p>Hi,</p><p>We have done levelling and alignment.&nbsp;Reduced the protrusion. Added IPR distal to upper canines. Maintained positive overjet and midline.However, we have manually adjusted the bite as the scans were distorted.&nbsp;</p><p>Kindly send in new plans for future proceedings.&nbsp;</p><p>Thankyou</p>', 0, 54, '2024-11-12 22:58:41', '2024-11-12 22:58:41'),
(1116, '3c2647e4-dac6-4226-9dd1-1bfacc3a2cbd', 828, 'D0409 (1).pdf_6RvGsZfhzD.pdf', 'https://treatmentplan.xyz/onyx/Viewer/show.html?mlink=https://treatmentplan.xyz/onyx/Client4745/D0409-Hasani%20Kawya/A225C712AD3F4D2A8FF7312D18B4ECA9.iiwgl&fg=000&bg=fff&p=DKBHNP', '<p>Upper scans are not workable due to extra material present between the centrals, which leads to unclear morphology .</p><p>Kindly send in new scans&nbsp;</p><p>Thanks</p>', 0, 37, '2024-11-12 23:14:21', '2024-11-12 23:14:21'),
