(739, '3a1f27e8-f4bb-49af-8fdc-dd5abc3478b5', 'CHANAKA DINETH', 'chanakakgsmc@gmail.com', NULL, 'No', 'Yes', 'D0395', '30', 'male', 'Yes', '<p>Close the space / lower IPR right 2 and 1 just polishing  left 1 and 2 / retrusion of lower and space closer in upper </p><p><br></p><p><br></p>', '<p>Close the space / lower IPR right 2 and 1 just polishing  left 1 and 2 / retrusion of lower and space closer in upper </p>', 'orthodontics_0bc62d9c_20241101114215_upper[1].stl_P0OZzwSMUw.stl', 'orthodontics_0bc62d9c_20241101114215_lower[1].stl_YNtiqJk3Y6.stl', '', 96, 11, 96, 0, 48, 0, 0, 59, NULL, '24', 'Universal notation', NULL, 2, 0, NULL, 96, 93, 'https://we.tl/t-lDy23b4f27', 1, '2024-11-08 12:25:17', 1731137117, NULL, NULL, NULL, '2024-11-02 13:18:38', '2024-11-22 18:37:52', NULL),
(740, '22162249-98ed-40bd-97e4-e0fd7998fb45', 'Madison Clark', '', NULL, 'No', 'Yes', '1', '14', 'female', 'No', '<p>just alignment </p><p><br></p>', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Expand 1.5 mm on each side of the arch and de-rotate the posteriors on upper and lower arches.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;During expansion keep long axis of the teeth perpendicular to the alveolar base by 4mm horizontal attachments<em>&nbsp;</em></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Procline upper lower anteriors and then align if required</p><p><br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Once aligned then Intrude lower anteriors by 2mm once  Optimized attachments with active surface towards gingival on posteriors</p><p><br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Match upper midline with lower midline&nbsp;</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;First open space and then start uprighting or aligning teeth </p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Level curve of spee on lowers by extrusion of posteriors </p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;DO NOT MATCH number of aligners on both arch&nbsp;</p>', 'scan UpperJawScan.stl_77ao7YM9gf.stl', 'scan LowerJawScan.stl_diW4tjBH1a.stl', 'scan BiteScan.stl_jW90baEdPv.stl', 134, 16, 134, 0, 47, 0, 0, 72, NULL, '8', 'Fdi Notation', NULL, 1, 0, NULL, 0, 0, 'https://we.tl/t-Wijs7tPJPQ', 1, '2024-11-09 04:02:38', 1731135758, 'local', 'Full arch correction', 'both', '2024-11-02 14:00:11', '2024-11-22 18:37:52', NULL),
(741, '59fb4fa1-9289-4496-b160-942b40125776', 'Ellie Lammas', '', NULL, 'No', 'Yes', '2', '10', 'female', 'No', '<p>excess overbite</p><p><br></p><p><br></p>', '<ul><li>place bigger retention attachments on all 6s both arch </li><li>shift 11,21 mesially by 50% each and then match lower midline with upper </li><li>DO NOT retract lower anteriors instead close spaces on anteriors by mesialization</li><li>expand lower arch by 2mm on each side</li><li>expand upper ach by 1mm on each side</li><li>place pontic on lower left side</li><li>place pontic or spacer on 32 for passive eruption</li><li>intrude upper and lower anteriors by 2mm </li><li>DO NOT MATCH number of aligners on both arch </li></ul><p><br></p>', 'scan UpperJawScan.stl_BhVCSneOIO.stl', 'scan LowerJawScan.stl_KIZQuKbBcm.stl', 'scan BiteScan.stl_CDSU7jofVa.stl', 134, 16, 134, 0, 78, 0, 0, 72, NULL, '8', 'Fdi Notation', NULL, 2, 0, NULL, 0, 0, 'https://we.tl/t-GrQ1288Vj5', 1, '2024-11-07 09:24:27', 1730982267, 'local', 'Full arch correction', 'both', '2024-11-02 14:28:51', '2024-11-22 18:37:52', NULL),
(742, '3f57fd41-152b-4fc3-a62a-9d7e3851faac', 'Lainey Van Groenewoud', '', NULL, 'No', 'Yes', '3', '13', 'female', 'No', '<p>increased Overjet and overbite </p><p><br></p>', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Expand 2mm on each side of the arch and de-rotate the posteriors on upper and lower arches.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;During expansion keep long axis of the teeth perpendicular to the alveolar base by 4mm horizontal attachments<em>&nbsp;</em></p><p><em>.       Derotate posteriros</em></p><p><br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Procline lower anteriors by 2 mm and then align them</p><p><br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Once aligned then Intrude upper and lower anteriors by 2mm once  Optimized attachments with active surface towards gingival on posteriors</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Once space created during expansion on upper arch then distalize premolars and canines to create space for anteriros for alignment and retraction</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Match upper midline with lower midline&nbsp;</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;First open space and then start uprighting or aligning teeth </p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Level curve of spee on lowers by extrusion of posteriors </p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;DO NOT MATCH number of aligners on both arch&nbsp;</p>', 'scan UpperJawScan.stl_tIvEwRM31K.stl', 'scan LowerJawScan.stl_D2KKrSblKi.stl', 'scan BiteScan.stl_nXmmdF6m8F.stl', 134, 7, 134, 0, 48, 0, 0, 0, NULL, '8', 'Fdi Notation', NULL, 2, 0, NULL, 0, 0, NULL, 1, '2024-11-03 08:49:22', 1730634562, 'local', 'Full arch correction', 'both', '2024-11-02 14:52:59', '2024-11-22 18:37:52', NULL),
(743, 'f808dc35-3d00-407f-9c0f-d1929b0535a5', 'Zachary Roberts', '', NULL, 'No', 'Yes', 'SZ004', '25', 'male', 'No', '<p>impacted teeth 15,23</p>', '<ul><li>baby teeth 55,63 will be extracted</li><li>place pontic on extraction site</li><li>level and align both arch</li><li>maintain space of 9 mm for 15,23</li><li>DO NOT retract upper anteriors</li><li>close remaining spaces by mesialzation on upper arch</li><li>intrude upper and lower anteriors</li><li>extrude lower posteriros to level curve of spee</li><li>DO NOT MATCH number of aligners on both arch</li></ul>', 'scan UpperJawScan.stl_tNAMBpohkH.stl', 'scan LowerJawScan.stl_49CSzOozZz.stl', 'scan BiteScan.stl_Ba0Zv6Mxyi.stl', 134, 7, 134, 0, 78, 0, 0, 0, NULL, '8', 'Fdi Notation', NULL, 3, 0, NULL, 0, 0, NULL, 1, '2024-11-03 03:36:29', 1730615789, 'local', 'Full arch correction', 'both', '2024-11-02 15:22:03', '2024-11-22 18:37:52', NULL),
(744, '834941c3-9b28-46e6-b7aa-f2ccbdcb96e3', 'Camila Dixon', '', NULL, 'No', 'Yes', 'SZ005', '45', 'female', 'No', '<p>crowding</p>', '<ul><li>level and align both arch</li><li>match upper midline with lower midline</li><li>do sequential distalization 50-50% on both arch to create space for alignment</li><li>do sequential distalization more on upper right to get canine class I\\</li><li>push 31 lingually</li><li>DO NOT procline lower anteriors</li><li>level curve of spee by intrusion of lower anteriors and extrusion of posteriors</li><li>expand 1mm on each side on both arch as crowns are tipped lingually</li><li>DO NOT MATCH number of aligners on both arch</li></ul><p><br></p>', 'scan UpperJawScan.stl_Naiit7et0O.stl', 'scan LowerJawScan.stl_MN8052hOlX.stl', 'scan BiteScan.stl_7oRIrfSwVd.stl', 134, 7, 134, 0, 45, 0, 0, 0, NULL, '8', 'Fdi Notation', NULL, 3, 0, NULL, 0, 0, NULL, 1, '2024-11-03 03:33:00', 1730615580, 'local', 'Full arch correction', 'both', '2024-11-02 15:36:01', '2024-11-22 18:37:52', NULL),
(745, 'f6308557-a534-43d2-8ccf-995892f4bf84', 'Khoulou ben Nasser', '', NULL, 'No', 'Yes', 'Y0081', '30', 'female', 'Yes', '<p>None</p>', '<p>This is a case of relapse .Please remove digitaly the fixed retainer lower .make expansion and alignment </p><p><br></p><p><br></p>', 'khouloud ben nasr-24102024-maxillary.stl_LJsfEuIE4B.stl', 'khouloud ben nasr-24102024-mandibular.stl_u1th8Yg8EI.stl', 'khouloud ben nasr-24102024-occlusionsecond.stl_IuCWYilENV.stl', 107, 7, 107, 0, 51, 0, 0, 0, NULL, '24', 'Universal notation', NULL, 1, 0, NULL, 0, 0, NULL, 1, '2024-11-02 12:04:00', 1730617440, 'local', '(3-3)', 'both', '2024-11-02 16:04:00', '2024-11-22 18:37:52', NULL),
(746, '393b6423-058f-4e66-88ff-d18d0aed0533', 'Rafael Aldeguer', '', NULL, 'No', 'Yes', 'SZ006', '9', 'male', 'No', '<p>no space for eruption of permanent teeth</p>', '<ul><li>expand 1.5mm on each side of both arch</li><li>close upper anteriors spaces by mesialization- DO NOT retract upper anteriors - keep equal spaces distal to 2s</li><li>only distalize 16,26 by 2mm</li><li>match upper midline with lower midline</li><li>place pontic on missing area on lower arch</li><li>tip lower anteriors lingually to correct edge to edge bite</li><li>DO NOT MATCH number of aligners on both arch</li></ul><p><br></p>', 'scan UpperJawScan.stl_BSIzrhphDC.stl', 'scan LowerJawScan.stl_PEfK2t4qzW.stl', 'scan BiteScan.stl_W7PCAfggD4.stl', 134, 16, 134, 0, 48, 0, 0, 72, NULL, '8', 'Fdi Notation', NULL, 3, 0, NULL, 0, 0, 'https://we.tl/t-ZEetOWAKch', 1, '2024-11-09 11:50:45', 1731163845, NULL, 'Full arch correction', 'both', '2024-11-02 16:06:16', '2024-11-22 18:37:52', NULL),
(747, '4f8680e0-107f-44ab-953a-ef3ea5148fc0', 'Ghozlane', '', NULL, 'No', 'Yes', 'Y0082', '30', 'female', 'Yes', '<p>Alignment of 15</p>', '<p>Stripping lower front and expansion upper and lower .You can add button on 17 and 15  in order to help the correction of 15 .</p><p><br></p><p><br></p>', 'ghozlane UpperJawScan.stl_nwiEq63YWC.stl', 'ghozlane LowerJawScan.stl_cxpGYqJKeJ.stl', 'ghozlane BiteScan.stl_yGBrcF1IiZ.stl', 107, 7, 107, 0, 68, 0, 0, 0, NULL, '8', 'Universal notation', NULL, 1, 0, NULL, 0, 0, NULL, 1, '2024-11-02 12:11:49', 1730560309, NULL, '(5-5)', 'both', '2024-11-02 16:11:49', '2024-11-22 18:37:52', NULL),
