(756, '8a364f3f-b92b-42f2-aa66-a33c769868f5', 'Jackson Smith', '', NULL, 'No', 'Yes', 'SZ007', '12', 'male', 'No', '<p>crowding</p>', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Expand 2mm on each side of the arch and de-rotate the posteriors on upper and lower arches.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;During expansion keep long axis of the teeth perpendicular to the alveolar base by 4mm horizontal attachments<em>&nbsp;</em></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Procline upper and lower anteriors by 2 mm and then align</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Perform IPR only if required from 4-4 only - least preference</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Once aligned then Intrude upper and lower anteriors by 2mm once  Optimized attachments with active surface towards gingival on posteriors</p><p><br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Shift upper midline 1mm right side and then match with lower midline</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;First open space and then start uprighting or aligning teeth</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Level curve of spee on lowers by extrusion of posteriors</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;DO NOT MATCH number of aligners on both arch&nbsp;</p>', 'scan UpperJawScan.stl_ikRa0yCZ8Y.stl', 'scan LowerJawScan.stl_AVpoyeLiTb.stl', 'scan BiteScan.stl_uCWZPLKHHP.stl', 134, 7, 134, 0, 43, 0, 0, 0, NULL, '8', 'Fdi Notation', NULL, 3, 0, NULL, 0, 0, NULL, 1, '2024-11-05 00:04:30', 1730775870, 'local', 'Full arch correction', 'both', '2024-11-03 15:49:54', '2024-11-22 18:37:52', NULL),
