(900, '473e28da-cef0-4005-8d13-1a6ce4cac60d', 'nushey khakwani', '', NULL, NULL, 'No', 'N0240', '20', 'female', NULL, '<p>Spacing nd leveling alignment required few aligners</p><p><br></p>', '<p>Reduce proclination of upper centrals and close upper anterior spaces only.&nbsp;</p><p>DO NOT MOVE POSTERIOR TEETH</p><p>DO NO TREAT LOWER ARCH</p><p>SHORT TREATMENT COURSE</p><p>Its a relapse case</p><p>URGENT case</p>', 'orthodontics_48_upper.stl_b6782EPkuc.stl', 'orthodontics_48_lower.stl_fS3nqksxkY.stl', 'orthodontics_48_buccal_1.stl_Vc1It8hH3c.stl', 108, 18, 108, 0, 85, 0, 0, 59, NULL, '24', 'Fdi Notation', NULL, 2, 0, NULL, 0, 0, 'https://we.tl/t-WVobtLu6DX', 1, '2024-11-13 01:10:16', 1731528616, 'overseas', '(3-3)', 'Upper only', '2024-11-11 06:20:11', '2024-11-22 18:37:54', NULL),
(901, '6a215fdc-3b3c-4fba-ac77-1460dac1b7d3', 'madni dental clinic', '', NULL, 'No', 'No', 'N0242', '23', 'male', 'No', '<p>minor protusion</p>', '<p>this is a relapse case required minimul aligner derotation of lateral incisors</p>', 'orthodontics_145_upper.stl_EeRPETPpX7.stl', 'orthodontics_145_lower.stl_NQaIMfdILR.stl', 'orthodontics_145_buccal_1.stl_XFCOnBKRGY.stl', 108, 18, 108, 0, 62, 0, 0, 72, NULL, '24', 'Fdi Notation', NULL, 3, 0, NULL, 0, 0, 'https://we.tl/t-UKD3z8W7LB', 1, '2024-11-13 15:48:35', 1731581315, 'local', '(3-3)', 'Upper only', '2024-11-11 06:25:57', '2024-11-22 18:37:54', NULL);
INSERT INTO `patient_cases` (`id`, `guid`, `name`, `email`, `phone`, `extraction`, `attachments`, `case_id`, `age`, `gender`, `ipr`, `chief_complaint`, `treatment_plan`, `stl_upper_file`, `stl_lower_file`, `stl_byte_scan_file`, `created_by`, `status`, `assign_to`, `created_by_admin`, `planner_id`, `qa_id`, `is_priority`, `post_processing_id`, `stl_file_by_post_processing`, `expected_time`, `tooth_label_format`, `setup_type`, `case_version`, `scan_version`, `container_file_by_post_processing`, `sub_client_id`, `client_id`, `stl_file_by_post_processing_we_transfer_link`, `verified_by_client`, `start_date_time`, `start_date_time_timestamp_string`, `patient_location`, `case_type`, `arch`, `created_at`, `updated_at`, `deleted_at`) VALUES
(902, '0a245f38-9e62-4427-b490-acdf0c80e953', 'imran', '', NULL, 'No', 'Yes', 'N0241', '22', 'male', 'Yes', '<p>Crowding</p>', '<p>Leveling alignment</p>', 'DR IMRAN WAZIRA BAD-upperjaw.stl_sUtmN0XGyc.stl', 'DR IMRAN WAZIRA BAD-lowerjaw.stl_tomM7XBh1F.stl', '', 108, 18, 108, 0, 84, 0, 0, 72, NULL, '24', 'Fdi Notation', NULL, 3, 0, NULL, 0, 0, 'https://we.tl/t-kjiCCFkQ09', 1, '2024-11-18 21:59:02', 1732035542, 'local', '(3-3)', 'Both Arch', '2024-11-11 06:34:45', '2024-11-22 18:37:54', NULL),
(903, 'bcb4a42a-adca-4863-8ab5-3bb6cb9a53e1', 'Liana Kuznetsova', '', NULL, 'No', 'Yes', 'SZ009', '14', 'female', 'No', '<p>crowding</p>', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Expand 2mm on each side of the arch and de-rotate the posteriors on upper and lower arches.</p><p><br></p><p><br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;During expansion keep long axis of the teeth perpendicular to the alveolar base by 4mm horizontal attachments<em>&nbsp;</em></p><ul><li>derotate 16,26,36,46 and use the space creates after derotation</li></ul><p><br></p><p><br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Procline upper and lower anteriors by 2 mm</p><p><br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Once aligned then Intrude upper and lower anteriors by 2mm once  Optimized attachments with active surface towards gingival on posteriors</p><p><br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Match lower midline with upper midline&nbsp;</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;First open space and then start uprighting or aligning teeth</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Level curve of spee on lowers by extrusion of posteriors</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;DO NOT MATCH number of aligners on both arch&nbsp;</p>', 'scan UpperJawScan.stl_R7kIFYhJVu.stl', 'scan LowerJawScan.stl_z5ywEzcruC.stl', 'scan BiteScan.stl_K1QS7oGuPr.stl', 134, 16, 134, 0, 52, 0, 0, 59, NULL, '8', 'Fdi Notation', NULL, 2, 0, NULL, 0, 0, 'https://we.tl/t-wStOMX09Sq', 1, '2024-11-13 02:27:37', 1731475657, 'local', 'Full arch correction', 'Both Arch', '2024-11-11 10:04:19', '2024-11-22 18:37:54', NULL),
(904, '8fe90122-a5fa-4dea-95f2-077b8bdf70d6', 'Aurelia Wilson', '', NULL, 'No', 'Yes', 'SZ010', '10', 'female', 'No', '<p>crowding</p>', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Expand 2mm on each side of the arch and de-rotate the posteriors on upper and lower arches.</p><p><br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;During expansion keep long axis of the teeth perpendicular to the alveolar base by 4mm horizontal attachments<em>&nbsp;</em></p><p><em>.</em> place pontic or spacer on 15,25 for passive eruption of teeth</p><p><br></p><p><br></p><p><br></p><p><br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Once aligned then Intrude upper and lower anteriors by 2mm once  Optimized attachments with active surface towards gingival on posteriors</p><p>&nbsp;&nbsp;&nbsp;&nbsp;AP correction with forward placement of lower jaw with class II elastics</p><p><br></p><p><br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Match upper midline with lower midline&nbsp;</p><p><br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;First open space and then start uprighting or aligning teeth</p><p><br></p><p><br></p><p><br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Level curve of spee on lowers by extrusion of posteriors</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;DO NOT MATCH number of aligners on both arch&nbsp;</p><p><br></p>', 'scans UpperJawScan.stl_wgHJWX1Nlt.stl', 'scans LowerJawScan.stl_Is5op4OOUF.stl', 'scans BiteScan.stl_sQCXehtMTY.stl', 134, 7, 134, 0, 47, 0, 0, 0, NULL, '8', 'Fdi Notation', NULL, 3, 0, NULL, 0, 0, NULL, 1, '2024-11-13 05:51:42', 1731487902, 'local', 'Full arch correction', 'Both Arch', '2024-11-11 10:38:14', '2024-11-22 18:37:54', NULL),
(905, 'c783f081-6241-4091-9f37-801cbca0160a', 'Cooper Hiestand Hutt', '', NULL, 'No', 'Yes', 'SZ011', '16', 'male', 'No', '<p>spacing and crowding</p>', '<p>need 2 plans - setup 1- treating only 3-3 both arch, level and align 3-3, place retention attachments on upper and lower 6s. Setup -2 - full treatment - level and align, intrude upper and lower anteriors, extrude lower posteriors, close spaces, DO NOT MATCH the number of aligners on both arch.</p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p>', 'scan UpperJawScan.stl_xC63hBgdKF.stl', 'scan LowerJawScan.stl_5VXFi4y8Dm.stl', 'scan BiteScan.stl_h7hbjsg67b.stl', 134, 7, 134, 0, 78, 0, 0, 0, NULL, '8', 'Fdi Notation', NULL, 2, 0, NULL, 0, 0, NULL, 1, '2024-11-11 05:56:10', 1731315370, 'local', 'Full arch correction', 'Both Arch', '2024-11-11 10:56:10', '2024-11-22 18:37:54', NULL),
(906, '80b435b1-0175-43d2-9583-678de38b1c5a', 'Talia Reeve', '', NULL, 'No', 'Yes', 'SZ012', '12', 'female', 'No', '<p>crowding</p>', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Expand 2mm on each side of the arch&nbsp;and de-rotate the posteriors on upper and lower arches.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;During expansion keep long axis of the teeth perpendicular to the alveolar base by 4mm horizontal attachments<em>&nbsp;</em></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Procline upper and lower anteriors by 2 mm</p><p><br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Once aligned then Intrude upper and lower anteriors by 2mm once  Optimized attachments with active surface towards gingival on posteriors</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;place long extrusion attachments on 13,23.43 and start aligning only once space is created.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Maintain midline match</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;First open space and then start uprighting or aligning teeth 13,23,43</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Level curve of spee on lowers by extrusion of posteriors</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;DO NOT MATCH number of aligners on both arch&nbsp;</p>', 'scan UpperJawScan.stl_29OIBmQVam.stl', 'scan LowerJawScan.stl_TYEAyXhaqp.stl', 'scan BiteScan.stl_npfgnIxMfC.stl', 134, 16, 134, 0, 48, 0, 0, 77, NULL, '8', 'Fdi Notation', NULL, 3, 0, NULL, 0, 0, 'https://we.tl/t-IBF7joEmWV', 1, '2024-11-29 08:01:57', 1732878117, 'local', 'Full arch correction', 'Both Arch', '2024-11-11 11:08:02', '2024-11-29 15:59:15', NULL),
(907, 'ab57434b-8b76-40fa-9551-f3df12b0c3d2', 'Evi Edgecombe', '', NULL, 'Yes', 'Yes', 'SZ013', '15', 'female', 'No', '<p>crowding and shift in midline on upper arch</p>', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Expand 1.5 mm on each side of the arch and de-rotate the posteriors on upper and lower arches.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;During expansion keep long axis of the teeth perpendicular to the alveolar base by 4mm horizontal attachments<em>&nbsp;</em></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Procline upper and lower anteriors by 1 mm</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Extract 14 and shift upper midline towards right side to match with lower midline.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Once aligned then Intrude upper and lower anteriors by 2mm once  Optimized attachments with active surface towards gingival on posteriors</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;DO NOt move 25 until space is created</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;derotate 16,26</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;First open space and then start uprighting or aligning teeth mainly 25</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Level curve of spee on lowers by extrusion of posteriors</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;DO NOT MATCH number of aligners on both arch&nbsp;</p>', 'scan UpperJawScan.stl_qU9rJDphKj.stl', 'scan LowerJawScan.stl_kH3GhU0Mbn.stl', 'scan BiteScan.stl_gn3N0inluv.stl', 134, 7, 134, 0, 45, 0, 0, 0, NULL, '8', 'Fdi Notation', NULL, 4, 0, NULL, 0, 0, NULL, 1, '2024-11-15 03:11:31', 1731651091, 'local', 'Full arch correction', 'Both Arch', '2024-11-11 11:23:49', '2024-11-22 18:37:54', NULL),
(908, '0bea2e6d-3d8a-49b4-92cc-624f59619619', 'Tallulah Goldsworthy', '', NULL, 'No', 'Yes', 'SZ014', '17', 'female', 'No', '<p>spacing and deepbite</p><p><br></p>', '<ul><li>treating only 3-3 both arch</li><li>place retention attachments on 6s on both arch</li><li>close spaces on upper arch</li><li>level and align both arch 3-3</li><li>DO NOT MATCH number of aligners on both arch</li></ul>', 'scan UpperJawScan.stl_4Z37cnLEHy.stl', 'scan LowerJawScan.stl_JtIUvM5Yth.stl', 'scan BiteScan.stl_OrRUupli4b.stl', 134, 7, 134, 0, 43, 0, 0, 0, NULL, '8', 'Fdi Notation', NULL, 2, 0, NULL, 0, 0, NULL, 1, '2024-11-11 07:17:40', 1731320260, 'local', '(3-3)', 'Both Arch', '2024-11-11 12:17:41', '2024-11-22 18:37:54', NULL),
(909, '359e5886-46b3-4027-9fad-6ee5e0389adf', 'Harry Smith', '', NULL, 'No', 'Yes', 'SZ015', '9', 'male', 'No', '<p>crowding</p>', '<ul><li>expand upper and lower arch from baby canine to 6s by 2mm on each side</li><li>move 11 mesially and close the spaces and then match midline with lower arch</li><li>place spacer / pontic on 12,22,14 for passive eruption</li><li>DO NOT retract lower anteriors instead derotate and align them</li><li>space created during expansion between baby teeth use them to create for anteriros by distalizing baby molars and canines</li><li>Place vertical attachments on 32,41,42</li><li>retention bigger attachments on all 6s</li></ul><p><br></p><ul><li>DO NOT MATCH number of aligners on both arch</li></ul>', 'scan UpperJawScan.stl_NG7wXIaEIN.stl', 'scan LowerJawScan.stl_7JyJWF4m8J.stl', 'scan BiteScan.stl_zjy4hNCM96.stl', 134, 16, 134, 0, 43, 0, 0, 77, NULL, '8', 'Fdi Notation', NULL, 4, 0, NULL, 0, 0, 'https://we.tl/t-yEOkVAhGbA', 1, '2024-11-23 07:15:28', 1732356928, 'local', 'Full arch correction', 'Both Arch', '2024-11-11 12:34:42', '2024-11-23 17:02:51', NULL),
