(965, 'ca5993c2-5e68-4772-80e1-fd0bf3b05153', 'Holly Cundell', '', NULL, 'No', 'Yes', 'SZ017', '11', 'female', 'No', '<p>anterior crossbite</p>', '<ul><li>expand upper and lower arch by 1mm on each side</li><li>place retention attachments on 16</li><li>procline 12 to correct crossbite</li><li>place rotation attachments on 34,44 and derotate</li><li>procline upper anteriors by placing +15 degree palatal root torque</li><li>level and align both arch</li><li>place pontic on upper missing teeth area</li><li>place bigger pontic or spacer on 24 for passive eruption</li><li>DO NOT MATCH number of aligners on both arch</li></ul>', 'scan UpperJawScan.stl_VtFaYEfdms.stl', 'scan LowerJawScan.stl_VFAdcvzPng.stl', 'scan BiteScan.stl_wIEWgIIovW.stl', 134, 16, 134, 0, 47, 0, 0, 77, NULL, '8', 'Fdi Notation', NULL, 3, 0, NULL, 0, 0, 'https://we.tl/t-A9iWhXnc1O', 1, '2024-11-19 01:51:52', 1731991912, 'local', 'Full arch correction', 'Both Arch', '2024-11-18 08:41:04', '2024-11-22 18:37:55', NULL),
