(967, 'f1d6fc62-409f-40b0-ba7d-22f20e344dc7', 'Ethan Holman', '', NULL, NULL, 'Yes', 'SZ018', '30', 'male', 'Yes', '<p>None- close midline space by moving 21 mesially and then match with lower midline</p><p>- level and align both arch&nbsp;</p><p>- level curve of spee by intrusion of lower anteriors and extrusion of lower posteriors</p><p>- close all spaces by mesialization of posteriors on both arch&nbsp;</p><p>- if required you can retract 1mm not more than that because teeth are already upright&nbsp;</p><p>- DO NOT MATCH number of aligners on both arch</p>', '<p>- close midline space by moving 21 mesially and then match with lower midline</p><p>- level and align both arch&nbsp;</p><p>- level curve of spee by intrusion of lower anteriors and extrusion of lower posteriors</p><p>- close all spaces by mesialization of posteriors on both arch&nbsp;</p><p>- if required you can retract 1mm not more than that because teeth are already upright&nbsp;</p><p>- DO NOT MATCH number of aligners on both arch</p>', 'Test-Ethan-Holman Upper.stl_qkxTSaft2J.stl', 'Test-Ethan-Holman Lower.stl_YiwGXGAbpC.stl', '', 134, 11, 134, 0, 0, 0, 0, 77, NULL, '24', 'Fdi Notation', NULL, 1, 0, NULL, 0, 0, 'https://we.tl/t-y5uUnHw3O6', 1, '2024-11-18 16:32:58', 1732015978, NULL, 'Full arch correction', 'Both Arch', '2024-11-18 21:10:45', '2024-11-22 18:37:55', NULL),
(968, '1b8df6e8-10ca-43bf-b7ab-50e3cd43c077', 'Ramsha', '', NULL, NULL, 'Yes', 'N0245', '23', 'female', 'Yes', '<p>Malalignment</p>', '<p>Movement of upper anteriors only try to cover this crowding in 10 aligners Avoid excessive attachments</p><p><br></p><p><br></p><p><br></p>', 'upper ramsha.stl_BBoH1w9493.stl', 'Lower Ramsha.stl_O3Vmkgj6Jy.stl', '', 108, 18, 108, 0, 42, 0, 0, 59, NULL, '24', 'Fdi Notation', NULL, 2, 0, NULL, 0, 0, 'https://we.tl/t-Wr1UJ7I9FB', 1, '2024-11-19 00:39:06', 1732045146, NULL, '(3-3)', 'Upper only', '2024-11-19 02:34:39', '2024-11-22 18:37:55', NULL),
(969, '8aa314bd-5b25-4826-ac14-598bd085627a', 'Nikolai Vulinovich', '', NULL, 'No', 'No', 'SZ019', '30', 'male', 'Yes', '<p>refinement case</p>', '<ul><li>do IPR from 4-4 and align lower anteriors</li><li>try to match lower midline with upper midline</li></ul>', 'scans UpperJawScan.stl_3kwqWubGEf.stl', 'scans LowerJawScan.stl_zyQ1LyPhzD.stl', 'scans BiteScan.stl_NtlVYARUOt.stl', 134, 16, 134, 0, 48, 0, 0, 77, NULL, '8', 'Fdi Notation', NULL, 2, 0, NULL, 0, 0, 'https://we.tl/t-tVN6i3KTNI', 1, '2024-11-20 04:31:24', 1732087884, 'local', '(5-5)', 'Lower only', '2024-11-19 08:43:49', '2024-11-22 18:37:55', NULL),
(970, '996e5bdb-0816-4aed-bf6a-97929fa37756', 'Jedidiah Saravanaselvam', '', NULL, 'No', 'Yes', 'SZ020', '16', 'male', 'No', '<p>refinement case</p>', '<ul><li>expand upper and lower arch by 1.5mm on each side to create space</li><li>level and align</li><li>extrude lower posteriors to level curve of spee</li><li>42 is touching palatal surface of 12 so retract lower anteriors</li><li>match lower midline with upper midline</li><li>better occlusion on right side</li><li>DO NOT MATCH number of aligners on both arch</li></ul>', 'scan UpperJawScan.stl_wjvqdX6VNG.stl', 'scan LowerJawScan.stl_b2CgyYJMpO.stl', 'scan BiteScan.stl_C2h0fDcKWL.stl', 134, 16, 134, 0, 78, 0, 0, 77, NULL, '8', 'Fdi Notation', NULL, 2, 0, NULL, 0, 0, 'https://we.tl/t-RQojOdrwtR', 1, '2024-11-20 01:07:19', 1732075639, 'local', 'Full arch correction', 'Both Arch', '2024-11-19 09:19:13', '2024-11-22 18:37:55', NULL),
(971, 'a37e4b5d-f42a-49c3-aa4c-2b5ad4dbe682', 'Sarah George', '', NULL, 'No', 'Yes', 'SZ021', '9', 'female', 'No', '<p>refinement</p>', '<ul><li>shift 11 50% towards midline and 21 50% towards midline and then match with lower midline</li><li>expand upper arch 0.5mm more on upper arch</li><li>retract upper anteriors</li><li>DO NOT RETRACT lower anteriors close spaces by mesilaization and keep extra spaces distal to laterals</li><li>intrude lower anteriors</li><li>intrude upper anteriors</li><li>DO NOT MATCH number of aligners on both arch</li></ul>', 'scan UpperJawScan.stl_u8wQPnY6NJ.stl', 'scan LowerJawScan.stl_t5eyPOkbtR.stl', 'scan BiteScan.stl_X3ptMB2UYX.stl', 134, 16, 134, 0, 78, 0, 0, 77, NULL, '8', 'Fdi Notation', NULL, 2, 0, NULL, 0, 0, 'https://we.tl/t-ackiQLcAo8', 1, '2024-11-20 04:29:40', 1732087780, 'local', 'Full arch correction', 'Both Arch', '2024-11-19 09:43:09', '2024-11-22 18:37:55', NULL),
(972, '38e66233-0c01-4b24-b9e2-e202925f2277', 'Bradley Gibson', '', NULL, 'No', 'Yes', 'SZ022', '25', 'male', 'No', '<p>refinement</p>', '<ul><li>procline upper anteriors and then tip crown of 11,21 right side to match with lower midline</li><li>procline lower anteriors and then align them</li><li>expand upper and lower posteriors by 1mm on each side to create more space</li><li>extrude lower posteriors to level the curve of spee</li><li>derotate 13,22,23,32,33,35,41,42,43,45</li><li>DO NOT MATCH number of aligners on both arch</li></ul><p><br></p><p><br></p><p><br></p>', 'scan UpperJawScan.stl_yr877ZlJoR.stl', 'scan LowerJawScan.stl_maDmwz5WGL.stl', 'scan BiteScan.stl_5jhYxngbEX.stl', 134, 16, 134, 0, 52, 0, 0, 77, NULL, '8', 'Fdi Notation', NULL, 2, 0, NULL, 0, 0, 'https://we.tl/t-m4E3XcA47S', 1, '2024-11-20 04:30:32', 1732087832, 'local', 'Full arch correction', 'both', '2024-11-19 11:05:09', '2024-11-22 18:37:55', NULL),
(973, 'e343efb0-c9eb-41fa-a5c5-2363b850daa7', 'Charlotte Penny', '', NULL, 'No', 'Yes', 'SZ023', '14', 'female', 'Yes', '<p>crowding</p>', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Expand 2mm on each side of the arch&nbsp;and de-rotate the posteriors on upper and lower arches.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;During expansion keep long axis of the teeth perpendicular to the alveolar base by 4mm horizontal attachments<em>&nbsp;</em></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;AP correction by getting lower jaw forward with class II elastics</p><p><br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Once aligned then Intrude upper and lower anteriors by 2mm once  Optimized attachments with active surface towards gingival on posteriors</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;retract upper and lower anteriros by IPR from 4-4 if required</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Match upper midline with lower midline&nbsp;</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;First open space and then start uprighting or aligning teeth</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Level curve of spee on lowers by extrusion of posteriors</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;DO NOT MATCH number of aligners on both arch&nbsp;</p>', 'scans UpperJawScan.stl_aPBvFAwRGJ.stl', 'scans LowerJawScan.stl_wkFwnKQLYk.stl', 'scans BiteScan.stl_yDLsyyH7BZ.stl', 134, 7, 134, 0, 48, 0, 0, 0, NULL, '8', 'Fdi Notation', NULL, 2, 0, NULL, 0, 0, NULL, 1, '2024-11-19 06:55:06', 1732010106, 'local', 'Full arch correction', 'both', '2024-11-19 11:55:06', '2024-11-22 18:37:55', NULL),
(974, 'd7918695-63ad-4f95-aadf-8b011a377e03', 'Kushi', '', NULL, 'No', 'Yes', 'SZ024', '21', 'female', 'Yes', '<p>crowding</p>', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Expand 1 mm on each side of the arch and de-rotate the posteriors on upper and lower arches.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;During expansion keep long axis of the teeth perpendicular to the alveolar base by 4mm horizontal attachments<em>&nbsp;</em></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Retract upper and lower anteriors by IPR</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Perform IPR only once tooth or teeth are aligned.&nbsp;</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Once aligned then Intrude upper and lower anteriors by 2mm once  Optimized attachments with active surface towards gingival on posteriors</p><p><br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Match upper midline with lower midline&nbsp;</p><p><br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;DO NOT MATCH number of aligners on both arch&nbsp;</p>', 'KUSHI Maxillary Anatomy.stl_bsx3kQ6jRO.stl', 'KUSHI Mandibular Anatomy_Normal Bite.stl_9cczH70B0H.stl', 'KUSHI Normal Bite.stl_zdC7O1yjzo.stl', 134, 16, 134, 0, 48, 0, 0, 77, NULL, '8', 'Fdi Notation', NULL, 2, 0, NULL, 0, 0, 'https://we.tl/t-yE8BCweyba', 1, '2024-12-04 06:28:18', 1733304498, 'local', 'Full arch correction', 'Both Arch', '2024-11-19 17:09:19', '2024-12-04 14:57:01', NULL);
