(975, '41339924-6ddb-4c0f-9d7a-6b8886a40edb', 'Sandunika', '', NULL, 'No', 'Yes', 'D0432', '24', 'female', 'Yes', '<p><span style=\"background-color: rgb(255, 255, 255); color: rgb(34, 34, 34);\">EXPANSION OF ARCH </span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(34, 34, 34);\">CORRECT MILD RETROCLINATION  IN THE ANTERIORS</span></p>', '<p><span style=\"color: rgb(34, 34, 34); background-color: rgb(255, 255, 255);\">EXPANSION OF ARCH </span></p><p><span style=\"color: rgb(34, 34, 34); background-color: rgb(255, 255, 255);\">CORRECT MILD RETROCLINATION IN THE ANTERIORS</span></p>', 'orthodontics_581_upper (1).stl_1V5nSUpMYh.stl', 'orthodontics_581_lower.stl_mYzC3ylTls.stl', 'orthodontics_581_buccal_2.stl_uJI3Vteb9Y.stl', 93, 7, 93, 0, 42, 0, 0, 0, NULL, '24', 'Universal notation', NULL, 1, 0, NULL, 0, 0, NULL, 1, '2024-11-19 14:01:42', 1732093302, 'local', 'Full arch correction', 'Both Arch', '2024-11-19 19:01:42', '2024-11-22 18:37:55', NULL),
(976, 'a9e0b892-f6ad-4b40-a486-998e75bd3c80', 'Ishara Dilshan', '', NULL, 'No', 'Yes', 'D0433 - Refinements', '33', 'male', 'Yes', '<p>ideal smile design	</p>', '<p>ideal smile design</p><p><br></p>', 'orthodontics_304_upper.stl_43cR04Xoip.stl', 'orthodontics_304_lower.stl_ItuWJEvar2.stl', '', 105, 11, 105, 0, 66, 0, 0, 77, NULL, '24', 'Universal notation', NULL, 1, 0, NULL, 105, 93, 'https://we.tl/t-zm31hcrHBl', 1, '2024-11-21 17:40:28', 1732279228, 'local', 'Full arch correction', 'Both Arch', '2024-11-19 19:13:36', '2024-11-22 18:37:55', NULL),
(977, '2dca3b35-873a-4f0b-b1a5-d689468a0494', 'Aleksandra Polukhina', '', NULL, 'No', NULL, 'P0166', '30', 'female', NULL, '<p>None</p>', '<p><br></p><p><span style=\"color: rgb(33, 37, 41);\">Upper jaw few aligners to correct upper 1.2 and expand</span></p>', 'P.A._20241118132023_UpperJaw.stl_81ZjPezXSi.stl', 'P.A._20241118132023_LowerJaw.stl_IAo16wDLpC.stl', '', 103, 7, 103, 0, 62, 0, 0, 0, NULL, '24', 'Universal notation', NULL, 2, 0, NULL, 0, 0, NULL, 1, '2024-11-19 15:23:30', 1732098210, NULL, NULL, 'Upper only', '2024-11-19 20:23:31', '2024-11-22 18:37:55', NULL),
(978, 'dc27e5d1-d119-42df-85b3-ee4ff450656e', 'Madiaan Bester', '', NULL, 'No', 'Yes', 'SZ025', '13', 'female', 'No', '<p>crowding</p>', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Expand 1.5 mm on each side of the arch and de-rotate the posteriors on upper and lower arches.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;During expansion keep long axis of the teeth perpendicular to the alveolar base by 4mm horizontal attachments<em>&nbsp;</em></p><p><br></p><p><br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Once aligned then Intrude upper and lower anteriors by 2mm once  Optimized attachments with active surface towards gingival on posteriors</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;First expand and then Do Sequential distalization ( 4mm vertical attachments) 50%-50% on arch to maintain class I - there is wisdom tooth 18 so distlaize not more than 2mm on right side</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Match upper midline with lower midline&nbsp;</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;First open space and then start uprighting or aligning teeth</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Level curve of spee on lowers by extrusion of posteriors</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;DO NOT MATCH number of aligners on both arch&nbsp;</p>', 'scan UpperJawScan.stl_SrIrpxxpJi.stl', 'scan LowerJawScan.stl_tUgTd0sP6h.stl', 'scan BiteScan.stl_K7C7iz987R.stl', 134, 16, 134, 0, 47, 0, 0, 77, NULL, '8', 'Fdi Notation', NULL, 2, 0, NULL, 0, 0, 'https://we.tl/t-kjn0cKT5bG', 1, '2024-11-23 07:20:26', 1732357226, 'local', 'Full arch correction', 'Both Arch', '2024-11-20 10:38:08', '2024-11-23 14:34:19', NULL),
(979, '88a392f3-526d-44bf-bd4f-6b4ce24f584f', 'Messina Haslett', '', NULL, 'No', 'Yes', 'SZ026', '10', 'female', 'No', '<p>crowding</p>', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Expand 2mm on each side of the arch and de-rotate the posteriors on upper and lower arches from baby canines to 1st molars, but expand 3 on right upper posteriors to correct crossbite</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;During expansion keep long axis of the teeth perpendicular to the alveolar base by 4mm horizontal attachments<em>&nbsp;</em></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Procline upper and lower anteriors by 1 mm</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Once aligned then Intrude upper and lower anteriors by 2mm once  Optimized attachments with active surface towards gingival on posteriors</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;First expand and then Do Sequential distalization ( 4mm vertical attachments) 50%-50% on upper arch on left side by 2mm</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Match upper midline with lower by shifitng towards right side and keep that space distal to 22</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Place pontic on misisng teeth area.</p><p><br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;DO NOT MATCH number of aligners on both arch&nbsp;</p>', 'scan UpperJawScan.stl_VUgSvM481m.stl', 'scan LowerJawScan.stl_WCd9mesEVB.stl', 'scan BiteScan.stl_68czE5tr89.stl', 134, 16, 134, 0, 78, 0, 0, 77, NULL, '8', 'Fdi Notation', NULL, 3, 0, NULL, 0, 0, 'https://we.tl/t-sIHN3vrRwP', 1, '2024-11-25 04:33:42', 1732520022, 'local', 'Full arch correction', 'Both Arch', '2024-11-20 14:13:04', '2024-11-25 16:06:48', NULL),
(980, '1da73f03-ce61-4ad7-95d5-4fdc9c823b6e', 'Solara Haslett', '', NULL, 'No', 'Yes', 'SZ027', '12', 'female', 'No', '<p>crowding</p>', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Expand 2mm on each side of the arch&nbsp;and de-rotate the posteriors on upper and lower arches.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;During expansion keep long axis of the teeth perpendicular to the alveolar base by 4mm horizontal attachments<em>&nbsp;</em></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Procline lower anteriors by 2 mm</p><p><br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Once aligned then Intrude upper and lower anteriors by 2mm once  Optimized attachments with active surface towards gingival on posteriors</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;First expand and then Do Sequential distalization ( 4mm vertical attachments) 50%-50% on ONLY upper right-side arch by 2mm</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Match upper midline with lower midline&nbsp;</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;First open space and then start uprighting or aligning teeth</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Level curve of spee on lowers by extrusion of posteriors</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;DO NOT MATCH number of aligners on both arch&nbsp;</p>', 'scan UpperJawScan.stl_0sbwkBdLIq.stl', 'scan LowerJawScan.stl_aV4z3Ru394.stl', 'scan BiteScan.stl_sXxHzilArP.stl', 134, 16, 134, 0, 48, 0, 0, 77, NULL, '8', 'Fdi Notation', NULL, 3, 0, NULL, 0, 0, 'https://we.tl/t-JDP9comeLF', 1, '2024-11-25 04:33:25', 1732520005, 'local', 'Full arch correction', 'Both Arch', '2024-11-20 14:23:27', '2024-11-25 16:28:46', NULL),
(981, 'abab89f5-7c14-4a3b-8f81-ee2096f047da', 'Rachel Shea', '', NULL, 'No', 'Yes', 'SZ028', '29', 'female', 'No', '<p>open bite</p>', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Expand 2 mm on each side of the arch and de-rotate the posteriors on upper arches.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;During expansion keep long axis of the teeth perpendicular to the alveolar base by 4mm horizontal attachments<em>&nbsp;</em></p><p><br></p><p><br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Once aligned then extrude upper anteriors by 2mm once  Optimized attachments with active surface towards gingival</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;First expand and then Do Sequential distalization ( 4mm vertical attachments) 50%-50% on both arch to maintain class I and create space for alignment - wisdom teeth need to be extracted</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Match upper midline with lower midline&nbsp;</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;First open space and then start uprighting or aligning teeth</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Intrude upper and lower posteriors one by one to close anterior open bite</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;DO NOT MATCH number of aligners on both arch&nbsp;</p>', 'scan UpperJawScan.stl_e7B2l1NzNv.stl', 'scan LowerJawScan.stl_q47awe9b3E.stl', 'scan BiteScan.stl_ONHsrPgas3.stl', 134, 7, 134, 0, 48, 0, 0, 0, NULL, '8', 'Fdi Notation', NULL, 2, 0, NULL, 0, 0, NULL, 1, '2024-11-20 11:43:07', 1732113787, 'local', 'Full arch correction', 'Both Arch', '2024-11-20 16:43:07', '2024-11-22 18:37:55', NULL),
(982, 'd53ab442-be67-475d-86be-6e471291545c', 'Hilary Whitmill', '', NULL, 'No', 'Yes', 'SZ029', '50', 'female', 'No', '<p>crowding</p>', '<ul><li>16 is implant</li><li>procline upper and lower anteriors and then align them</li><li>do sequential distalization on both arch if need more space except on upper right side</li><li>match upper midline with lower midline</li><li>DO NOT MATCH number of aligners on both arch</li></ul>', 'scan UpperJawScan.stl_XnrqvJW4En.stl', 'scan LowerJawScan.stl_94ee6qGXsW.stl', 'scan BiteScan.stl_0Za5IsL48c.stl', 134, 7, 134, 0, 78, 0, 0, 0, NULL, '8', 'Fdi Notation', NULL, 2, 0, NULL, 0, 0, NULL, 1, '2024-11-20 12:02:52', 1732114972, 'local', 'Full arch correction', 'Both Arch', '2024-11-20 17:02:53', '2024-11-22 18:37:55', NULL),
