(1011, '8987f5a6-12d1-4bb9-ba52-72bc077da0a7', 'Austin Boyce', '', NULL, 'No', 'Yes', 'SZ032', '25', 'male', 'No', '<p>crowding</p>', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Expand 2mm on each side of the arch&nbsp;and de-rotate the posteriors on upper and lower arches.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;During expansion keep long axis of the teeth perpendicular to the alveolar base by 4mm horizontal attachments<em>&nbsp;</em></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Procline upper and lower anteriors by 2 mm</p><p><br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Once aligned then Intrude upper and lower anteriors by 2mm once  Optimized attachments with active surface towards gingival on posteriors</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;First expand and then Do Sequential distalization ( 4mm vertical attachments) 50%-50% on both arch to maintain class I - wisdom teeth need to be extracted</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Match upper midline with lower midline&nbsp;</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;First open space and then start uprighting or aligning teeth - 15,25,35</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Level curve of spee on lowers by extrusion of posteriors</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;DO NOT MATCH number of aligners on both arch&nbsp;</p>', 'scan UpperJawScan.stl_ro30Oe8GXL.stl', 'scan LowerJawScan.stl_rz8QKoVFyu.stl', 'scan BiteScan.stl_vOfqLcA4vl.stl', 134, 7, 134, 0, 48, 0, 0, 0, NULL, '8', 'Fdi Notation', NULL, 3, 0, NULL, 0, 0, NULL, 1, '2024-11-27 01:29:15', 1732681755, 'local', 'Full arch correction', 'Both Arch', '2024-11-26 16:55:07', '2024-11-27 18:38:28', NULL),
(1012, '8a0b43c7-f542-4558-ad30-b804e8edf945', 'Kenzie De Villiers', '', NULL, 'No', 'Yes', 'SZ033', '12', 'female', 'No', '<p>crowding</p>', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Expand 2mm on each side of the arch and de-rotate the posteriors on upper and lower arches.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;During expansion keep long axis of the teeth perpendicular to the alveolar base by 4mm horizontal attachments<em>&nbsp;</em></p><p><em>. DO NOT align or move 42 until space is created </em></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Procline upper and lower anteriors by 2 mm</p><p><br></p><p><br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Once aligned then Intrude lower anteriors by 2mm once  Optimized attachments with active surface towards gingival on posteriors</p><p><br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Shift lower midline towards left side by 3mm and then match with upper midline</p><p><br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;85 baby molar will be extracted so distalize 44,43 by 2mm into Es space and remaining Es space maintain with pontic</p><p><br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;First open space and then start uprighting or aligning teeth</p><p><br></p><p>. Derotate 16,26</p><p><br></p><p><br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Level curve of spee on lowers by extrusion of posteriors</p><p><br></p><p><br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;DO NOT MATCH number of aligners on both arch&nbsp;</p>', 'scans UpperJawScan.stl_ZeOs7ag3u4.stl', 'scans LowerJawScan.stl_4RXB4P0M0w.stl', 'scans BiteScan.stl_bb4sByKM1O.stl', 134, 7, 134, 0, 43, 0, 0, 0, NULL, '8', 'Fdi Notation', NULL, 3, 0, NULL, 0, 0, NULL, 1, '2024-11-27 01:55:26', 1732683326, 'local', 'Full arch correction', 'Both Arch', '2024-11-26 17:18:23', '2024-11-27 19:02:43', NULL),
